(18, 'en', 'common', 'copyright', 'Copyright &#169; [year] www.seopanel.in All rights reserved', '2010-09-08 02:59:30'),
(19, 'en', 'home', 'home_cont1', '<h1 style="text-align: center;margin-bottom: 30px;font-size: 19px;">Welcome to Seo Panel - World''s first seo control panel for multiple websites</h1>\r\n		<p>\r\n			A complete <b>open source seo control panel</b> for managing <b>search engine optimization</b> of your websites. \r\n			Seo Panel is a <b>seo tool kit</b> includes latest hot seo tools to <b>increase and track</b> the <b>performace</b> of your websites.\r\n			It is a <b>free software</b> released under <b>GNU GENERAL PUBLIC LICENSE</b>.\r\n			The main feature of seo panel is its <b>extendability</b> by using <a href="<?=SP_PLUGINSITE?>" target="_blank">seo plugins</a>.\r\n			Any one can easily <b>develop and install</b> required plugins for their seo panel. \r\n		</p>\r\n		<p></p>\r\n		<p>\r\n			This open source software was <b>released on January 2010</b>.\r\n			With in this <b>short period</b> of  time <b>thousands</b> of <b>web masters</b> are using this software for <b>optimizing</b> their websites.\r\n			Use seo panel today itself and <b>enjoy</b> everything related to seo under a <b>single platform</b>.\r\n		</p>', '2010-09-08 03:13:06'),
(20, 'en', 'home', 'home_cont2', '<fieldset>\r\n<legend>Major Features of Seo Panel <?=SP_INSTALLED?></legend>\r\n<ul class="infobox">\r\n	<li>		\r\n		<h1>Automatic Directory Submission Tool</h1>\r\n		<p>\r\n			Automatic directory submission tool help us to <b>submit our websites</b> into to major <b>free and paid internet directories</b>.\r\n			We can also <b>track the status</b> of each submision through <b>periodical check</b> using submission <b>status checker script</b>.\r\n			<b>Directory manager</b> will help us to find out whether <b>directory is active</b> or not.\r\n		</p>\r\n	</li>\r\n	<li>		\r\n		<h1>Keyword Position Checker</h1>\r\n		<p>\r\n			Keyword position checker will find the <b>search engine position</b> of <b>targetted keywords</b> of your website and <b>stores</b> it in the system.\r\n			In keyword position reports section, we can see the <b>daily positions</b> of keywords in different search engines by <b>beautiful graphs</b> and <b>detailed reports</b>.\r\n		</p>\r\n	</li>\r\n	<li>		\r\n		<h1>Site Auditor</h1>\r\n		<p>Site Auditor will <b>audit all SEO factors</b> of each pages of a site and will give a <b>detailed report</b> about each page. This will help us to create <b>XML,HTML,TEXT</b> sitemap files of our website for <b>submit</b> to search engines.</p>\r\n	</li>\r\n	<li>		\r\n		<h1>Google and Alexa Rank Checker</h1>\r\n		<p>\r\n			Google and alexa rank checker will find <b>google pagerank</b> and <b>alexa rank</b> of our websites and <b>stores</b> it in the system.\r\n			In <b>rank reports</b> section, we can see the <b>daily</b> google and alexa rank of each website by <b>detailed reports</b>.\r\n		</p>\r\n	</li>\r\n	<li>		\r\n		<h1>Backlinks Checker</h1>\r\n		<p>\r\n			Backlinks checker will find <b>number of backlinks</b> of our websites in different search engines<b>(google,yahoo,msn etc)</b> and <b>stores</b> it in the system.\r\n			<br>In <b>backlink reports</b> section, we can see the <b>daily backlinks count</b> of each website by <b>detailed reports</b>.\r\n		</p>\r\n	</li>	\r\n	<li>		\r\n		<h1>Search Engine Saturation Checker</h1>\r\n		<p>\r\n			Search Engine Saturation checker will find <b>number of indexed pages</b> of our websites in different search engines<b>(google,yahoo,msn etc)</b> and <b>stores</b> it in the system.\r\n			In <b>search engine saturation checker reports</b> section, we can see the <b>daily indexed page count</b> of each website by <b>detailed reports</b>.\r\n		</p>\r\n	</li>\r\n	<li>		\r\n		<h1>Seo Panel Plugins</h1>\r\n		<p>\r\n			The <b>major feature</b> of seo control panel is its <b>extentability</b>.\r\n			Add <b>seo plugins</b> to your seo panel to <b>extend the features</b> according to your requirement.\r\n			<a href="<?=SP_PLUGINSITE?>" target="_blank">Seo panel plugins</a> are provided by both seo panel and third party sites.\r\n			You can also easily <b>develop</b> seo plugins for your seo panel.\r\n			You can <a href="<?=SP_PLUGINSITE?>" target="_blank">submit</a> your seo plugin to seo panel and we will <b>publish</b> it in our website after our <b>review</b> process.\r\n		</p>\r\n	</li>\r\n	<li>		\r\n		<h1>Meta Tag Generator</h1>\r\n		<p>\r\n			Meta tag generator is a <b>seo panel plugin</b> for creating <b>custom meta tags</b> for our site.\r\n			It will help us to give <b>more information</b> about our website to <b>search engine bots</b> while they crawl our website.\r\n		</p>\r\n	</li>\r\n</ul>\r\n</fieldset>', '2011-07-05 03:20:22'),
(21, 'en', 'home', 'home_cont3', '<fieldset>\r\n<legend>Seo Panel Online Resources</legend>	\r\n<ul class="infobox">\r\n\r\n	<li>\r\n		<h1>Seo Panel Online Resources for Reference</h1>				\r\n		\r\n		\r\n		<p>\r\n			<a href="http://www.seopanel.in" target="_blank">Seo Panel Official Site</a>\r\n		</p>\r\n		<p>\r\n			<a href="<?=SP_DOWNLOAD_LINK?>" target="_blank">Download Seo Panel</a>\r\n		</p>\r\n		\r\n		<p>\r\n			<a href="<?=SP_DEMO_LINK?>" target="_blank">Seo Panel Demo</a>\r\n		</p>\r\n		\r\n		<p>\r\n			<a href="<?=SP_CONTACT_LINK?>" target="_blank">Conatct Seo Panel</a>\r\n		</p>\r\n		\r\n		<p>\r\n			<a href="<?=SP_HELP_LINK?>" target="_blank">Seo Panel Help Guide</a>\r\n		</p>\r\n		\r\n		<p>\r\n			<a href="<?=SP_FORUM_LINK?>" target="_blank">Seo Panel Forum</a>\r\n		</p>\r\n		\r\n		<p>\r\n			<a href="<?=SP_SUPPORT_LINK?>" target="_blank">Seo Panel Support System</a>\r\n		</p>\r\n		\r\n		<p>\r\n			<a href="<?=SP_DONATE_LINK?>" target="_blank">Donate to Seo Panel</a>\r\n		</p>\r\n	</li>\r\n	\r\n</ul>\r\n</fieldset>', '2010-09-08 03:24:46'),
(22, 'en', 'support', 'support_cont1', '<fieldset>\r\n<legend>Seo Panel Support System</legend>\r\n<ul class="infobox">\r\n	<li>\r\n		<h1>1000 Directory Package</h1> \r\n		<p>\r\n			We are providing <b>1000 free active and verified</b> internet directory package, to add into your seo panel <b>directory submission tool</b>.\r\n			It will help you to <b>increase the backlinks</b> of your websites.\r\n			Actually 1000 directory list is <b>introduced</b> to collect some money for <b>future development</b> of seo panel.\r\n			To get the 1000 directory list please <a href="<?=SP_DONATE_LINK?>" target="_blank">donate</a> $10 or more to improve the features of seo panel.\r\n			If you have any questions about 1000 directory package, please <a href="<?=SP_CONTACT_LINK?>" target="_blank">contact us</a> or open a ticket in <a href="<?=SP_SUPPORT_LINK?>" target="_blank">support system</a>.   \r\n		</p>		\r\n		<p>\r\n			<a href="<?=SP_DONATE_LINK?>" target="_blank">Visit this link to donate to seo panel</a>\r\n		</p>\r\n		<br>\r\n	</li>\r\n	\r\n	<li>\r\n		<h1>Local Search Engines Package</h1> \r\n		<p>\r\n			Add <b>local search engine domains</b> of google,yahoo,msn(<b>eg: www.google.de,www.google.fr etc</b>) to seo panel <b>keyword position checker</b>, to track your site perfomance locally.\r\n			To get local search engines package(according to your requirement) please <a href="<?=SP_DONATE_LINK?>" target="_blank">donate</a> $10 or more to improve the features of seo panel.\r\n			Before sending donation, please <a href="<?=SP_CONTACT_LINK?>" target="_blank">contact us</a> to provide us required search engine domain list.\r\n			<br><br>			  \r\n			Also to add <b>new search engines(eg:baidu.com)</b> to your seo panel keyword position checker, please <a href="<?=SP_CONTACT_LINK?>" target="_blank">contact us</a> or open a ticket in <a href="<?=SP_SUPPORT_LINK?>" target="_blank">support system</a>. \r\n		</p>		\r\n		<p class="visit">\r\n			<a href="<?=SP_CONTACT_LINK?>" target="_blank">Visit this link to contact us</a>\r\n		</p>\r\n		<br>\r\n	</li>\r\n	\r\n	<li>\r\n		<h1>Seo Panel Plugins</h1> \r\n		<p>\r\n			Add <b>seo plugins</b> to your seo panel to <b>extend the features</b> according to your requirement.\r\n			<a href="<?=SP_PLUGINSITE?>" target="_blank">Seo panel plugins</a> are provided by both seo panel and third party sites.\r\n			You can also easily <b>develop</b> seo plugins for your seo panel.\r\n			You can <a href="<?=SP_PLUGINSITE?>" target="_blank">submit</a> your seo plugin to seo panel and we will <b>publish</b> it in our website after our <b>review</b> process.        \r\n		</p>		\r\n		<p>\r\n			<a href="<?=SP_PLUGINSITE?>" target="_blank">Visit this link to get seo panel plugins</a>\r\n		</p>\r\n		<br>\r\n	</li>	\r\n	<li>\r\n		<h1>Contact Us</h1> \r\n		<p>\r\n			Contact us for any questions about <b>seo panel tools,plugins and features etc</b> by using below link.        \r\n		</p>		\r\n		<p>\r\n			<a href="<?=SP_CONTACT_LINK?>" target="_blank">Visit this link to contact us</a>\r\n		</p>\r\n		<br>\r\n	</li>	\r\n	<li>\r\n		<h1>Support Tickets</h1> \r\n		<p>\r\n			To get <b>technical support</b> from seo panel team to setup the <b>seo panel tools,plugins and features</b>. Eg: To set up cron for keyword position checker.\r\n		</p>		\r\n		<p>\r\n			<a href="<?=SP_SUPPORT_LINK?>" target="_blank">Visit this link to create a support ticket</a>\r\n		</p>\r\n		<br>\r\n	</li>	\r\n	<li>\r\n		<h1>Report Bugs</h1> \r\n		<p>\r\n			Report <b>bugs</b> about <b>seo panel tools,plugins and features etc</b> by using below link. \r\n			please help us to improve the features in next versions.          \r\n		</p>		\r\n		<p>\r\n			<a href="<?=SP_SUPPORT_LINK?>" target="_blank">Visit this link to report bugs</a>\r\n		</p>\r\n		<br>\r\n	</li>	\r\n</ul>\r\n</fieldset>', '2010-09-08 03:42:25'),
(23, 'en', 'support', 'support_cont2', '<fieldset>\r\n<legend>Seo Panel Online Resources</legend>\r\n<ul class="infobox">\r\n		\r\n	<li>\r\n		<h1>Seo Panel Help Guide</h1> \r\n		<p>\r\n			You can view the <a href="<?=SP_HELP_LINK?>" target="_blank">seo panel documentation</a> in the <b>help guide</b>, it contains the <b>documentation</b> for the seo panel tools,plugins and related features.\r\n			<br>It is the best place in internet to <b>get help</b> about seo panel. We hope that you <b>contribute</b> to the seo panel help guide, if you find errors or things missing.  	          \r\n		</p>\r\n		<p>\r\n			<a href="<?=SP_HELP_LINK?>" target="_blank">Visit seo panel help guide</a>\r\n		</p>\r\n		<br>\r\n	</li>	\r\n	<li>\r\n		<h1>Seo Panel Forum</h1> \r\n		<p>\r\n			A place to discuss about world''s first open source <b>seo control panel</b>. \r\n			It is the best place to find the <b>answers</b> to <b>your questions</b> about seo panel. \r\n			<br>Also you can <b>share</b> your <b>experience</b> while using seo panel for optimizing your websites.			     	          \r\n		</p>		\r\n		<p>\r\n			<a href="<?=SP_FORUM_LINK?>" target="_blank">Visit seo panel forum</a>\r\n		</p>\r\n		<br>\r\n	</li>\r\n</ul>	\r\n</fieldset>', '2010-09-08 03:43:38'),
(24, 'en', 'support', 'support_cont3', '<fieldset>\r\n<legend>Donate to Seo Panel</legend>\r\n<ul class="infobox">		\r\n	<li>\r\n		<h1>Donate to Seo Panel - First Open source seo control panel in the world</h1> \r\n		<p>\r\n			<b>Donate</b> to seo panel to support first open source seo control panel in the world.\r\n			We are planning to <b>add and improve</b> features of seo panel in future. \r\n			<br>With all your <b>support</b> only we can achieve our <b>goals</b>.\r\n			If you feel that seo panel is <b>worth</b> for you, please donate some amount to seo panel team.\r\n			<br>We will <b>publish</b> your name and site information in <a href="<?=SP_DONATE_LINK?>" target="_blank">donation page</a>, once we get donation.\r\n		</p>\r\n		<p>\r\n			<a href="<?=SP_DONATE_LINK?>" target="_blank">Visit this link to donate to seo panel</a>\r\n		</p>\r\n		<br>\r\n	</li>\r\n</ul>\r\n</fieldset>', '2010-09-08 03:43:38'),
