(489, 'es', 'home', 'home_cont1', '<h1 style=\\"text-align: center;margin-bottom: 30px;font-size: 19px;\\">Bienvenido a Seo Panel  El primer panel de control SEO para la supervisin de sitios web.</h1>\r\n\r\n<p>Un programa <b>open source</b> para la <b>gestin y optimizacin</b> de sus sitios web ideal para conseguir <b>primeras posiciones en los buscadores</b> ms destacados.\r\nEn este panel de control encontraras las herramientas imprescindibles para que su sitio web pueda tener unas posiciones preferentes en los buscadores. Este <b>software es completamente libre</b> y esta bajo la licencia <b>GNU GENERAL PUBLIC LICENSE</b>.</p><p></p>\r\n<p>Una de las mejores caractersticas de este panel de control, es la posibilidad de <b>ampliacin mediante plugins</b> ya sean realizados por terceros o realizados por nosotros mismos, la incorporacin de estos plugins sera sencilla y rpida permitiendo as poder evolucionar la herramienta a la misma velocidad que las nuevas directrices SEO.</p>\r\n', '2012-05-31 05:06:10'),
(4672, 'cs', 'website', 'Edit Website', 'Upravit website', '2011-03-21 08:43:51'),
(490, 'es', 'home', 'home_cont2', '<fieldset>\r\n<legend>Caracteristicas principales de SEO PANEL <?=SP_INSTALLED?></legend>\r\n<ul class=\\"infobox\\">\r\n\r\n<li>\r\n<h1>Herramienta para la automatizacin de entradas en directorios.</h1>\r\n<p>\r\nEsta herramienta nos permitir <b>semi automatizar las entradas de nuestras webs a directorios</b> gratuitos y de pago. Una de sus caractersticas principales es la posibilidad de seguir y controlar si el directorio finalmente ha dado de alta nuestra web en su directorio de forma automtica, siendo el seguimiento de las altas mucho ms sencillo y eficaz.\r\n</p>\r\n</li>\r\n \r\n<li>\r\n<h1>Herramienta automtica de seguimiento de la posicin de una palabra en un buscador.</h1>\r\n<p>\r\nEsta herramienta nos permitir seguir la <b>evolucin de una palabra</b> en un buscador concreto, obteniendo informacin diaria de su posicin y de su evolucin, podremos ver y exportar estos datos de forma grfica o incluso en otros formatos de fichero.\r\n</p>\r\n</li>\r\n<li>\r\n<h1>Site Auditor</h1>\r\n<p><p>Site Auditor will <b>audit all SEO factors</b> of each pages of a site and will give a <b>detailed report</b> about each page.\r\nEsta herramienta nos permitir crear en formatos <b>XML, HTML, TEXT</b> los mapas de nuestras pginas webs para facilitar la indexacin a los buscadores.\r\n</p>\r\n</li>\r\n\r\n<li>\r\n<h1>Verificador del ranking en Google y Alexa.</h1>\r\n<p>\r\nDispondrs de una utilidad para seguir diariamente la evolucin de tus pginas web en los <b>rankings de Google y Alexa</b>.\r\n</p>\r\n</li>\r\n\r\n<li>\r\n<h1>Herramienta de backlinks</h1>\r\n<p>\r\nPodrs ver la evolucin de los <b>backlinks</b> de tus pginas web de una forma diaria, rapida y efectiva en los buscadores ms populares de la red como <b>Google, Yahoo, Msn</b> y ms que podres incorporar mediante plugins.\r\n</p>\r\n</li>\r\n\r\n<li>\r\n<h1>Medidor del ndice de saturacin</h1>\r\n<p>\r\nPodrs obtener el nmero de <b>pginas indexadas</b> de tus web y de esta forma ver la evolucin diaria de como los buscadores indexan tu pgina web.\r\n</p>\r\n</li>\r\n\r\n<li>\r\n<h1>Incorporacin de nuevos Plugins</h1>\r\n<p>\r\nEs una de las funciones ms potentes de este panel de control, ya que nos permitir expandir nuestra informacin a nuestro gusto. Todo el mundo <b>puede desarrollar plugins</b> para nuestra plataforma y de este modo aumentar las posibilidades del panel de control. Si ud. desarrolla una Plugin para nuestro panel de control, lo publicaremos en nuestra pgina web para que todos los usuarios puedan disfrutar de l.\r\n</p>\r\n</li>\r\n\r\n<li>\r\n<h1>Generador de Meta-Tags</h1>\r\n<p>\r\nDisponemos de una utilidad para poder generar de forma fcil y cmoda el cdigo necesario para que todos los<b> META TAG</b> de sus paginas web estn generados de una forma correcta y de esta forma incentivar a los buscadores a darnos su mejor posicin en el ndice.\r\n</p>\r\n</li>\r\n</fieldset>', '2012-05-31 05:06:10'),
