(696, 'fr', 'home', 'home_cont1', '<h1 style=\\"text-align: center;margin-bottom: 30px;font-size: 19px;\\">Bienvenue sur le site de Seo Panel - Le premier panneau de contrle Seo multisite au monde</h1>\r\n        <p>\r\n            <b>Seo Panel</b> est un <b>panneau de contrle Seo, open source</b>, pour grer le <b>rfrencement</b> de vos sites internet.\r\n            Seo Panel est une <b>boite  outils</b> intgrant les tous derniers outils Seo pour <b>suivre et optimiser</b> les <b>rsultats</b> de vos sites.\r\n            C\\''est un <b>logiciel libre</b>, sous licence <b>GNU GENERAL PUBLIC LICENSE</b>.\r\n\r\n            L\\''atout majeur de Seo Panel est d\\''tre <b>volutif</b> grce  son systme de <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">plugins Seo</a>.\r\n            Tout le monde peut <b>dvelopper et installer</b> facilement des plugins pour ajouter de nouvelles fonctionnalits.</p>\r\n        <p></p>\r\n        <p>\r\n            Ce logiciel open source a <b>vu le jour en janvier 2010</b>.\r\n            Depuis cette date, des <b>milliers</b> de <b>webmasters</b> utilise ce logiciel pour le rfrencement de leurs sites.\r\n            Utilisez Seo Panel ds aujourd\\''hui, et <b>apprciez</b> l\\''intgration de <b>toutes les techniques Seo</b> dans un seul et mme outil, <b>Seo Panel</b>.\r\n        </p>', '2011-07-10 04:56:55'),
(697, 'fr', 'home', 'home_cont2', '<fieldset>\r\n<legend>Principales fonctionnalits de Seo Panel <?=SP_INSTALLED?></legend>\r\n<ul class=\\"infobox\\">\r\n    <li>        \r\n        <h1>Outil de soumission automatise</h1>\r\n        <p>\r\n            L\\''outil de soumission automatise permet de <b>soumettre vos sites internet</b> aux principaux <b>annuaires gratuits et commerciaux</b>.\r\n            Le <b>statut</b> de chaque soumission peut tre <b>suivi priodiquement</b> par le <b>script de contrle</b>.\r\n            Le <b>gestionnaire d\\''annuaires</b> vous aidera  vrifier le statut de chacun des annuaires.\r\n        </p>\r\n    </li>\r\n    <li>        \r\n        <h1>Contrle de position sur mot-cl</h1>\r\n        <p>\r\n            L\\''outil de contrle de position sur mot-cl va trouver et sauvegarder la <b>position de votre site</b> dans les moteurs de recherche pour les <b>mots-cls viss</b>.\r\n            Dans la section des rapports de position, un <b>suivi quotidien et dtaill</b> des positions sur les diffrents mots-cls dans les moteurs de recherche est prsent <b>sous forme graphique</b>.\r\n        </p>\r\n    </li>\r\n    <li>        \r\n        <h1>Vrificateur de site</h1>\r\n        <p>Le vrificateur de site va <b>vrifier tous les paramtres SEO</b> des pages du site audit, et fournir un <b>rapport dtaill</b> sur chacune des pages. Cela permet de crer des fichiers sitemap <b>XML, HTML, ou texte</b> de votre site, afin de les <b>envoyer aux moteurs de rechercher.</b></p>\r\n    </li>\r\n    <li>        \r\n        <h1>Contrle des rangs Google et Alexa</h1>\r\n        <p>\r\n            L\\''outil de contrle du rang Google et Alexa va trouver et sauvegarder les <b>rangs Google et Alexa</b> de vos sites.\r\n            Dans la section rapports de rang, un <b>suivi quotidien et dtaill</b> du rang Google et du rang Alexa est effectu, pour chacun de vos sites.\r\n        </p>\r\n    </li>\r\n    <li>        \r\n        <h1>Contrle des liens retour</h1>\r\n        <p>\r\n            Le contrle des liens retour permet de trouver et sauvegarder le <b>nombre de liens retour</b> vers vos sites sur les diffrents moteurs de recherche <b>(Google, Yahoo, MSN, ...)</b>.\r\n            <br>Dans la section des rapports sur liens retour, vous pouvez voir un <b>comptage quotidien et dtaill des liens retour</b> de chacun des sites.\r\n        </p>\r\n    </li>    \r\n    <li>        \r\n        <h1>Contrle de saturation des moteurs de recherche</h1>\r\n        <p>\r\n            Le contrle de saturation va trouver et sauvegarder le <b>nombre de pages indexes</b> de vos sites, sur les diffrents moteurs de recherche <b>(Google, Yahoo, MSN, ...)</b>.<br>\r\n            Dans les rapports de saturation, vous pouvez voir les <b>dtails quotidiens</b> du <b>nombre de pages indexes</b> pour chacun de vos sites.\r\n        </p>\r\n    </li>\r\n    <li>        \r\n        <h1>Plugins Seo Panel</h1></h1>\r\n        <p>\r\n        	Le <b>principal atout</b> de Seo Panel est son <b>volutivit</b>.\r\n        	Ajoutez <b>vos propres plugins</b> pour <b>tendre les fonctionnalits</b> de votre Seo Panel, selon vos besoins.<br/>\r\n            Les <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">plugins Seo Panel</a> sont disponibles via le site Seo Panel, ou par des tiers.\r\n            Vous pouvez facilement <b>dvelopper</b> des plugins pour votre Seo Panel, \r\n            Et vous pouvez aussi <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">soumettre</a> vos plugins  Seo Panel. Ils seront <b>publis</b> sur notre site, aprs validation.\r\n        </p>\r\n    </li>\r\n    <li>        \r\n        <h1>Gnrateur de tags Meta</h1>\r\n        <p>\r\n            Le gnrateur de tags Meta est un <b>plugin Seo Panel</b> permettant de crer des <b>tags Meta personnaliss</b> pour vos sites.\r\n            Il vous aidera  donner <b>plus d\\''informations</b> sur vos sites aux <b>robots de recherche</b> lors de leurs visites.\r\n        </p>\r\n    </li>\r\n</ul>\r\n</fieldset>', '2011-07-10 04:56:55'),
(698, 'fr', 'home', 'home_cont3', '<fieldset>\r\n<legend>Seo Panel - Ressources en ligne</legend>    \r\n<ul class=\\"infobox\\">\r\n\r\n    <li>\r\n        <h1>Rfrences Seo Panel</h1>                \r\n        \r\n        \r\n        <p>\r\n            <a href=\\"http://www.seopanel.in\\" target=\\"_blank\\">Site officiel Seo Panel</a>\r\n        </p>\r\n        <p>\r\n            <a href=\\"<?=SP_DOWNLOAD_LINK?>\\" target=\\"_blank\\">Tlcharger Seo Panel</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_DEMO_LINK?>\\" target=\\"_blank\\">Site de dmonstration Seo Panel</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">Contacter l\\''quipe Seo Panel</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">Guide Seo Panel</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_FORUM_LINK?>\\" target=\\"_blank\\">Forum Seo Panel</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">Support Seo Panel</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">Faites un don pour Seo Panel</a>\r\n        </p>\r\n    </li>\r\n    \r\n</ul>\r\n</fieldset>', '2011-07-10 04:56:55'),
