(1251, 'pl', 'support', 'support_cont1', '<fieldset> \r\n<legend>System Wsparcia Seo Panel</legend> \r\n<ul class=\\"infobox\\"> \r\n    <li> \r\n        <h1>Pakiet 1000 Katalogw</h1>  \r\n        <p> \r\n            Dostarczamy <b>1000 darmowych aktywnych i zweryfikowanych</b> katalogw internetowych w jednym pakiecie, gotowe do dodania do Twojego panelu Seo  <b>Narzdzia do submisji Seo</b>. \r\n            Pomoe Ci to <b>powikszy liczb backlinkw</b> twoich Stron. \r\n            Waciwie to lista 1000 Katalogw jest <b>wprowadzona</b> aby zebra troch pienidzy na <b>rozwijanie funkcjonalnoci</b> Seo Panel. \r\n            Aby otrzyma list 1000 internetowych Katalogw prosimy <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">o zoenie donacji</a>\r\n$10 lub wicej aby pomc nam rozwin funkcjonalno Seo Panel. \r\n            Jeeli masz jakie pytania dotyczce pakietu 1000 Katalogw, prosimy <a href=\\"<?=SP_CONTACT_LINK?>\\"\r\ntarget=\\"_blank\\">o kontakt</a> lub utwrz pytanie <a href=\\"<?=SP_SUPPORT_LINK?>\\"\r\ntarget=\\"_blank\\">w systemie wsparcia</a>.    \r\n        </p>         \r\n        <p> \r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">Otwrz link aby zoy donacj dla Seo Panel</a> \r\n        </p> \r\n        <br> \r\n    </li> \r\n     \r\n    <li> \r\n        <h1>Lokalny pakiet Wyszukiwarek</h1>  \r\n        <p> \r\n            Dodaj <b>lokalne wyszukiwarki</b> google,yahoo,msn(<b>np: www.google.de,www.google.fr\r\nitd.</b>) do Seo Panel <b>sprawdzenie pozycji Keyword\\''w</b>, aby ledzi wydajno twoich Stron w lokalnych wyszukiwarkach. \r\n            Aby otrzyma pakiet lokalnych wyszukiwarek (w zalenoci od twoich wymaga) prosimy <a\r\nhref=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">o donacj</a> $10 lub wicej aby pomc w rozwoju funkcjonalnoci Seo Panel. \r\n            Przed zoeniem donacji, prosimy <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">o kontakt</a> aby powiadomi nas o danej licie lokalnych wyszukiwarek. \r\n            <br><br>               \r\n            Zawsze dodawaj <b>nowe wyszukiwarki (np:baidu.com)</b> do Sprawdzania pozycji Keyword\\''w w Seo Panel,\r\nprosimy <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">o kontakt</a> lub utworzenie pytania w <a\r\nhref=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">systemie wsparcia</a>.  \r\n        </p>         \r\n        <p class=\\"visit\\"> \r\n            <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">Otwrz link aby skontaktowa si z nami</a> \r\n        </p> \r\n        <br> \r\n    </li> \r\n     \r\n    <li> \r\n        <h1>Pluginy Seo Panel</h1>  \r\n        <p> \r\n            Dodaj <b>pluginy seo</b> do Twojego Seo Panel by <b>rozszerzy funkcjonalno</b> wedug twoich wymaga. \r\n            <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">Pluginy Seo Panel</a> s dostarczane przez Seo Panel oraz zewntrznych rde. \r\n            Moesz take rwnie atwo <b>tworzy</b> pluginy Seo dla Twojego Seo Panel. \r\n            Moesz take <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">submitowa</a> twoje pluginy do Seo Panel a my je <b>opublikujemy</b>na naszej stronie po uprzednim <b>zatwierdzeniu</b>.         \r\n        </p>         \r\n        <p> \r\n            <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">Otwrz link aby scign pluginy Seo Panel</a> \r\n        </p> \r\n        <br> \r\n    </li>     \r\n    <li> \r\n        <h1>Kontakt</h1>  \r\n        <p> \r\n            Skontaktuj si z Nami jeli masz pytanie dotyczce <b>Narzdzi Seo Panel, pluginw oraz funkcjonalnoci itp.</b> prze uycie poniszego linka.         \r\n        </p>         \r\n        <p> \r\n            <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">Otwrz link aby skontaktowa si z Nami</a> \r\n        </p> \r\n        <br> \r\n    </li>     \r\n    <li> \r\n        <h1>System Zapyta</h1>  \r\n        <p> \r\n            Aby uzyska <b>pomoc techniczn</b> od teamu Seo Panel odnonie instalacji i ustawie Narzdzi Seo Panel, pluginw i funkcjonalnoci</b>. Np: Aby ustawi zadania Cron dla automatycznego sprawdzania pozycji Keyword\\''w. \r\n        </p>         \r\n        <p> \r\n            <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">Otwrz link aby utworzy zapytanie</a> \r\n        </p> \r\n        <br> \r\n    </li>     \r\n    <li> \r\n        <h1>Raportowanie bdw</h1>  \r\n        <p> \r\n            Raportuj <b>bdy</b> w <b>Narzdziach Seo Panel, pluginach i funkcjonalnoci itp.</b> uywajc poniszego linka.  \r\n            Prosimy o pomoc w usprawnieniu funkcjonalnoci w nowych wersjach.           \r\n        </p>         \r\n        <p> \r\n            <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">Otwrz link aby raportowa bd</a> \r\n        </p> \r\n        <br> \r\n    </li>     \r\n</ul> \r\n</fieldset>', '2010-10-25 01:08:20'),
(1252, 'pl', 'support', 'support_cont2', '<fieldset> \r\n<legend>Seo Panel Zasoby Online</legend> \r\n<ul class=\\"infobox\\"> \r\n         \r\n    <li> \r\n        <h1>Pomoc Uytkownika Seo Panel</h1>  \r\n        <p> \r\n            Dokumentacja Seo Panel jest dostpna na <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\"> w\r\n<b>Pomocy Uytkownika</b></a>, zawiera ona <b>dokumentacj</b> Narzdzi Seo Panel, plugin\\''w , i funkcjonalnoci. \r\n            <br>To jest najlepsze miejsce w internecie aby <b>znale pomoc</b> o Seo Panel. mamy nadziej e pomoesz \r\n<b>udoskonali</b> Pomoc Uytkownika, jeli znajdziesz jaki bd lub brak czego.                 \r\n        </p> \r\n        <p> \r\n            <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">Zobacz Pomoc Uytkownika Seo Panel</a> \r\n        </p> \r\n        <br> \r\n    </li>     \r\n    <li> \r\n        <h1>Forum Seo Panel</h1>  \r\n        <p> \r\n            To miejsce do dyskusji o pierwszym na wiecie opensource\\''owym <b> panelem kontrolym seo</b>.  \r\n            To najlepsze miejsce by znale <b>odpowied</b> na <b>Twoje pytania</b> o Seo Panel.  \r\n            <br>Moesz take <b>dzieli si</b> twoim <b>dowiadczeniem</b> z uytkowanie Seo Panel do optymalizacji twoich Stron.                                \r\n        </p>         \r\n        <p> \r\n            <a href=\\"<?=SP_FORUM_LINK?>\\" target=\\"_blank\\">Odwied forum Seo Panel</a> \r\n        </p> \r\n        <br> \r\n    </li> \r\n</ul>     \r\n</fieldset>', '2010-10-25 01:08:20'),
(1253, 'pl', 'support', 'support_cont3', '<fieldset> \r\n<legend>Z donacj dla Seo Panel</legend> \r\n<ul class=\\"infobox\\">         \r\n    <li> \r\n        <h1>Z donacj dla Seo Panel - Pierwszy na wiecie Open source\\''owy panel kontrolny seo</h1>  \r\n        <p> \r\n            <b>Z donacj</b> dla Seo Panel aby wesprze pierwszy na wiecie open source\\''owy panel kontrolny seo. \r\n            Planujemy <b>zwiksza i ulepsza</b> funkcjonalo Seo Panel w przyszoci.  \r\n            <br>Tylko z Twoim <b>wsparciem</b> moemy osign nasz <b>cel</b>. \r\n            Jeeli uwaasz e Seo Panel jest dla Ciebie <b>cenny</b>, prosimy o donacj jakiejkolwiek kwoty dla Seo Panel. \r\n            <br>W zamian <b>opublikujemy</b> Twoje Nazwisko i adres twojej strony na <a href=\\"<?=SP_DONATE_LINK?>\\"\r\ntarget=\\"_blank\\">stronie donacji</a>, jak tylko otrzymamy donacj. \r\n        </p> \r\n        <p> \r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">Otwrz t link i z donacj dla Seo Panel</a> \r\n        </p> \r\n        <br> \r\n    </li> \r\n</ul> \r\n</fieldset>', '2010-10-25 01:08:20'),
