(1405, 'pl', 'home', 'home_cont1', '<h1 style="text-align: center;margin-bottom: 30px;font-size: 19px;">Witamy w Seo Panel - pierwszym na wiecie panelu kontrolnym dla wielu Stron</h1> \r\n        <p> \r\n           Kompletne rdo <b> Seo Panel</b> do zarzdzania <b>Optymalizacj dla Wyszukiwarek (Search Engine Optimization)</b> twoich Stron.  \r\n            Seo Panel jest to zbir <b>Narzdzi Seo</b> wczajc najnowsze narzdzia aby <b>zwikszy kontrol i wydajno</b> twoich Stron. \r\n            Jest to <b>darmowe narzdzie</b> rozpowszechniane na licencji <b>GNU GENERAL PUBLIC LICENSE</b>. \r\n            Gwn funkcj Seo Panel jest <b>rozszerzalno</b> o nowe <a href="<?=SP_PLUGINSITE?>"\r\ntarget="_blank">pluginy Seo</a>. \r\n            Kady moe atwo <b>tworzy i instalowa</b> pluginy do swojego Seo Panel.  \r\n        </p> \r\n        <p></p> \r\n        <p> \r\n            Jest to Open source''owe oprogramowanie <b>wydane w Styczniu 2010</b>. \r\n            W tym <b>krtkim okresie</b> czasu <b>tysic</b> of <b>web masterw</b> uywaj ten software do <b>optymalizowania</b> swoich Stron. \r\n            Uzyj Seo Panel dzisiaj i <b>ciesz</b> si pen kontrol Seo w jednym narzdziu</b>. \r\n        </p>', '2014-01-17 14:23:11'),
(1406, 'pl', 'home', 'home_cont2', '<fieldset> \r\n<legend>Gwne fukcje Seo Panel <?=SP_INSTALLED?></legend> \r\n<ul class="infobox"> \r\n    <li>         \r\n        <h1>Narzdzie to automatycznej submisji Stron do Katalogw</h1> \r\n        <p> \r\n            Narzdzie to automatycznej submisji Stron do Katalogw pomaga nam <b>submitowa Strony</b> do najwikszych<b> darmowych i patnych Katalogw</b>. \r\n            Moemy rwnie <b>ledzi status</b> kadej submisji przez <b>okresowe sprawdzania statusw</b>. \r\n            <b>Manader Katalogw</b> pomoe nam sprawdzi czy dany <b>katalog jest aktywny</b> czy nie. \r\n        </p> \r\n    </li> \r\n    <li>         \r\n        <h1>Sprawdzenie pozycji sw kluczowych</h1> \r\n        <p> \r\n            Sprawdzenie pozycji keyword''w  pozwoli znale <b>pozycj w wyszukiwarkach</b> dla <b>zdefiniowanych Keyword''w</b> dla twojej Strony. \r\n           W raportach moemy zobaczy <b>dzienne pozycje</b> Keyword''w w rnych wyszukiwarkach, <b>pikne wykresy</b> i <b> szczegowe raporty</b>. \r\n        </p> \r\n    </li> \r\n    <li>         \r\n        <h1>Audytor Strony</h1> \r\n        <p>Audytor Strony sprawdzi <b>wszystkie skadniki SEO</b> kadje strony i wygeneruje <b>dokadny raport</b> o kadje stronie. Pomoe nam rwnie wygenerowa mapy Strony <b>XML,HTML,TEXT</b> w formie plikw gotowe do <b>submitowania</b> do wyszukiwarek.</p> \r\n    </li> \r\n    <li>         \r\n        <h1>Sprawdzanie Google Rank i Alexa Rank</h1> \r\n        <p> \r\n            Sprawdzacz Google Rank i Alexa Rank znajdzie <b>google pagerank</b> i <b>alexa rank</b> naszych stron i <b>zapisze</b> je w systemie. \r\n            W sekcji <b>Raport rankingw</b>, moemy zobaczy <b>dzienne</b> rankingi google i alexa rank kadej Strony w <b>szczegowym raporcie</b>. \r\n        </p> \r\n    </li> \r\n    <li>         \r\n        <h1>Sprawdzanie linkw zwrotnych</h1> \r\n        <p> \r\n            Sprawdzanie backlinkw znajdzie <b>liczb backlinkw</b> w rnych wyszukiwarkach <b>(google,yahoo,msn itd.)</b> i <b>zapisuje</b> je w systemie. \r\n            <br>W sekcji <b>Sprawdzanie backlinkw</b>, moemy zobaczy <b>dzienne raporty</b> ze sprawdzania backlinkow kadej Strony <b>ze szczegami</b>.\r\n        </p> \r\n    </li>     \r\n    <li>         \r\n        <h1>Sprawdzanie Nasycenia w Wyszukiwarkach</h1> \r\n        <p> \r\n            Sprawdzanie Nasycenia w Wyszukiwarkach znajdzie <b>liczb zaindexowanych podstron</b> naszych Stron w rnych wyszukiwarkach <b>(google,yahoo,msn etc)</b> i <b>zapisze</b> je w systemie. \r\n            W sekcji <b>raport nasycenia w wyszukiwarkach</b> moemy zobaczy <b>dzienn liczb zaindeksowanych podstron</b> i <b>szczegowy raport</b> o kadej Stronie. \r\n        </p> \r\n    </li> \r\n    <li>         \r\n        <h1>Pluginy Seo Panel</h1> \r\n        <p> \r\n            <b>Gwn funkcjonalnoci</b> Seo Panel jest <b>rozszerzalno</b>. \r\n            Dodaj <b>pluginy Seo</b> do twojego Seo Panel aby <b>rozszerzy funkcjonalno</b> wedug twoich potrzeb.\r\n            <a href="<?=SP_PLUGINSITE?>" target="_blank">Pluginy Seo Panel</a> s dostarczane przez Seo Panel oraz rda zewntrzne. \r\n            Moesz atwo <b>tworzy</b> pluginy Seo dla swojego Seo Panel. \r\n            moesz <a href="<?=SP_PLUGINSITE?>" target="_blank">submitowa</a> twoje pluginy do Seo Panel a my je <b>opublikujemy</b> na naszej stronie po uprzednim <b>sprawdzeniu</b>. \r\n        </p> \r\n    </li> \r\n    <li>         \r\n        <h1>Generator tagw Meta</h1> \r\n        <p> \r\n            Generator tagw Meta jest take <b>pluginem Seo</b> do generowania <b>wasnych tagw Metas</b> na nasz Stron. \r\n           Pomoe nam to da <b>wicej informacji</b> o naszej Stronie dla <b>robotw wyszukiwarek</b>\r\npodczas indeksowanie Strony. \r\n        </p> \r\n    </li> \r\n</ul> \r\n</fieldset>', '2014-01-17 14:23:11'),
(1407, 'pl', 'home', 'home_cont3', '<fieldset> \r\n<legend>Zasoby online dla Seo Panel</legend>     \r\n<ul class="infobox"> \r\n\r\n    <li> \r\n        <h1>Zasoby online dla Seo Panel dla szybkiej referencji</h1>                 \r\n         \r\n         \r\n        <p> \r\n            <a href="http://www.seopanel.in" target="_blank">Oficjalna strona Seo Panel</a> \r\n        </p> \r\n        <p> \r\n            <a href="<?=SP_DOWNLOAD_LINK?>" target="_blank">Scignij Seo Panel</a> \r\n        </p> \r\n         \r\n        <p> \r\n            <a href="<?=SP_DEMO_LINK?>" target="_blank">Demo Seo Panel</a> \r\n        </p> \r\n         \r\n        <p> \r\n            <a href="<?=SP_CONTACT_LINK?>" target="_blank">Skontaktuj si z Seo Panel</a> \r\n        </p> \r\n         \r\n        <p> \r\n            <a href="<?=SP_HELP_LINK?>" target="_blank">Pomoc Uytkownika Seo Panel</a> \r\n        </p> \r\n         \r\n        <p> \r\n            <a href="<?=SP_FORUM_LINK?>" target="_blank">Forum Seo Panel</a> \r\n        </p> \r\n         \r\n        <p> \r\n            <a href="<?=SP_SUPPORT_LINK?>" target="_blank">System Wsparcia Seo Panel</a> \r\n        </p> \r\n         \r\n        <p> \r\n            <a href="<?=SP_DONATE_LINK?>" target="_blank">Z donacj dla Seo Panel</a> \r\n        </p> \r\n    </li> \r\n     \r\n</ul> \r\n</fieldset>', '2014-01-17 14:23:11'),
