(1613, 'hu', 'home', 'home_cont1', '<h1 style=\\"text-align: center;margin-bottom: 30px;font-size: 19px;\\">dvzllek a Seo Panelben - A vilg els nylt forrskd Seo Segdjben</h1> \r\n<p> \r\nEz egy teljesen <b>ingyenes</b> eszkz, mely nagy mrtkben megknnyti a <b>keresoptimalizlst</b>. Egyszerre tbb npszer Seo eszkzt foglal magban, hogy weblapjbl a maximumot hozhassa ki. Nylt forrskd (GNU GENERAL PUBLIC LICENSE) ezrt n is fejleszthet hozz klnbz kiegsztket.\r\nLegfbb tulajdonsga a <b>bvthetsg</b>, mivel knnyedn bvteni lehet <a href=\\"<?=SP_PLUGINSITE?>\\"\r\ntarget=\\"_blank\\">seo kiegsztkkel</a>. \r\n</p>\r\n <p></p>\r\n <p> Ez az ingyenes software <b>2010 Janurjban</b> lett kzztve. Azta tbb <b>ezer</b> <b>webmester</b> hasznlja vilgszerte.\r\n</p>', '2011-07-11 01:21:07'),
(1614, 'hu', 'home', 'home_cont2', '<fieldset>\r\n<legend>A Seo Panel legfbb Tulajdonsgai <?=SP_INSTALLED?></legend>\r\n<ul class=\\"infobox\\">\r\n    <li>        \r\n        <h1>Automatikus linkbeklds katalgusokba</h1>\r\n        <p>\r\n            Az automatikus linkbekld eszkz segt nnek, hogy <b>weboldalai</b> bekerljenek a legnagyobb <b>ingyenes s fizets katalgusokba.</b>\r\n            A beklds utn az <b>llapotellenrz scripttel</b> <b>ellenrizheti</b> minden egyes katalgusban <b>linkjei llapott</b>.\r\n          Ezen fell a <b>Katalgusrendez</b> segt nnek, hogy mely <b> katalgusok mkdnek</b> s melyek azok amik mr nem.\r\n        </p>\r\n    </li>\r\n    <li>        \r\n        <h1>Kulcssz helyezs Viszgl</h1>\r\n        <p>\r\n            A <b>kulcssz helyezs</b> vizsgl segtsgvel ellenrizheti, hogy az n ltal <b>vlasztott kulcsszavak</b> milyen helyen szerepelnek a keresk <b>tallati listjn</b>.\r\n            A Helyezsekrl <b>rszletes</b>, grafikus jelentseket kszthet, ahol megtekintheti kulcsszavainak <b>napi pozcijt</b> a klnbz keresk tallati listjn.\r\n        </p>\r\n    </li>\r\n    <li>        \r\n        <h1>Site Auditor</h1>\r\n        <p>Site Auditor will <b>audit all SEO factors</b> of each pages of a site and will give a <b>detailed report</b> about each page. A Seo Panel segtsgvel klnbz formtum(<b>XML,HTML,TEXT</b>) oldaltrkpet kszthet, amit ksbb <b>bekldhet</b> a keresknek.</p>\r\n    </li>\r\n    <li>        \r\n        <h1>Google and Alexa Rang Ellenrz</h1>\r\n        <p>\r\n            A Google s Alexa rang ellenrz segtsgvel megtudhatja oldalnak <b>Pagerank</b>-jt, valamint az <b>Alexa pozcijt</b>. A kapott adatokat <b>eltrolhatja</b>.\r\n          A trolt adatokrl <b>jelentseket</b> kszthet, amiben weboldalainak napi Pagerankja s Alexa pozcija lesz lthat.\r\n        </p>\r\n    </li>\r\n    <li>        \r\n        <h1>Backlink Ellenrz</h1>\r\n        <p>\r\n            A Backlink ellenrzvel megtudhatja, hogy a klnbz keresk<b>(google,yahoo,msn etc)</b> <b>mennyi linket</b> ltnak amik az n oldalra mutatnak. A kapott adatokat <b>eltrolhatja</b>.\r\n                      <br> A trolt adatokrl <b>jelentseket</b> kszthet, amiben weboldalainak backlinjeinek szmt lthatja napi lebontsban.\r\n        </p>\r\n    </li>    \r\n    <li>        \r\n        <h1>Indexelt oldalak</h1>\r\n        <p>\r\n            Az Indexelt oldalak vizsglatval kiderl, hogy a klnbz kereskben<b>(google,yahoo,msn stb..)</b> mennyi <br>indexelt oldala</br> van a weblapjnak. A kapott adatokat <b>eltrolhatja</b>.\r\n\r\n              A trolt adatokrl <b>jelentseket</b> kszthet, amiben az <br>indexelt oldalak</br> szmt napi nzetben lthatja.\r\n        </p>\r\n    </li>\r\n    <li>        \r\n        <h1>Seo Panel Kiegsztk</h1>\r\n        <p>\r\n            A legfbb <b>tulajdonsga</b>  a Seo Panel-nek a <b>bvthetsg</b>. Tovbbi kiegsztket itt tud letlteni: <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">Seo panel kiegsztk</a>.\r\n           \r\n            \r\n            Knnyedn <b>fejleszthet</b> n is Seo Kiegsztket a Seo Panelhez.\r\n            Az n ltal fejlesztett kiegsztket <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">bekldheti</a> a Seo Panel oldalra, ahol egy rvid ttekints utn <b>megjelenik</b> a tbbi kiegszt kztt.\r\n        </p>\r\n    </li>\r\n    <li>        \r\n        <h1>Meta Tag Genertor</h1>\r\n        <p>\r\n            A meta tag genertor egy <b>Seo panel kiegszt</b> amivel <b>egyedi meta tagokat</b> kszthet weboldalai szmra.\r\n        \r\n        </p>\r\n    </li>\r\n</ul>\r\n</fieldset>', '2011-07-11 01:21:07'),
(1615, 'hu', 'home', 'home_cont3', '<fieldset>\r\n<legend>Tovbbi informcik a Seo Panelrl</legend>    \r\n<ul class=\\"infobox\\">\r\n\r\n    <li>\r\n        <h1>Seo Panel a neten</h1>                \r\n        \r\n        \r\n        <p>\r\n            <a href=\\"http://www.seopanel.in\\" target=\\"_blank\\">Seo Panel Hivatalos Oldala</a>\r\n        </p>\r\n        <p>\r\n            <a href=\\"<?=SP_DOWNLOAD_LINK?>\\" target=\\"_blank\\">Seo Panel Letltse</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_DEMO_LINK?>\\" target=\\"_blank\\">Seo Panel Dem</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">Kapcsolat</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">Seo Panel Kziknyv</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_FORUM_LINK?>\\" target=\\"_blank\\">Seo Panel Frum</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">Seo Panel Segtsgnyjts</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">Seo Panel Tmogatsa</a>\r\n        </p>\r\n    </li>\r\n    \r\n</ul>\r\n</fieldset>', '2011-07-11 01:21:07'),
