(2050, 'nl', 'support', 'support_cont1', '<fieldset>\r\n<legend>Seo Panel Support Systeem</legend>\r\n<ul class=\\"infobox\\">\r\n	<li>\r\n		<h1>1000 Directories Pakket</h1> \r\n		<p>\r\n			Wij bieden een pakket aan met <b>1000 gratis, actieve en gecontroleerde </b> Directories, ter integratie in uw <b>Directory Inschrijving Tool</b>.\r\n			Dit zal helpen het aantal <b>backlinks</b> van uw eigen websites <b>aanzienlijk te verhogen</b>.\r\n			Wij bieden deze lijst momenteel aan om geld in te zamelen voor <b>de toekomstige ontwikkelingen</b> van Seo panel. \r\n			<a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">Doneer</a> $10 of meer om Seo Panel verder te helpen ontwikkelen en verbeteren.\r\n			Als u vragen hebt over het 1000 directories pakket, neem dan gerust<a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">contact</a> op of open een ticket in het <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">support</a> systeem.\r\n		</p>		\r\n		<p>\r\n			<a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">Klik hier om een donatie aan Seo Panel te doen.</a>\r\n		</p>\r\n		<br>\r\n	</li>\r\n	\r\n	<li>\r\n		<h1>Het Lokale Zoekmachine Pakket</h1> \r\n		<p>\r\n			Voeg <b>lokale zoekmachines</b> toe van google,yahoo en msn (<b>Bv.: www.google.nl, www.google.fr etc</b>) aan Seo Panel <b>Posities en Zoekwoorden</b>, om uw site performance lokaal te kunnen controleren. \r\n			Om het lokale zoekmachines pakket (op basis van uw behoefte) te ontvangen <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">doneert u</a> $10 of meer om de functies van SEO panel te verbeteren.\r\n			Neemt u voordat u doneert  <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">contact</a> met ons op met een lijst van de gewenste lokale zoekmachine toevoegingen.\r\n			<br><br>			  \r\n			Om <b>nieuwe zoekmachines (bijvoorbeeld: baidu.com)</b> toe te voegen, neemt u <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">contact</a> met ons op of opent u een ticket in het <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">Support System</a>. \r\n		</p>		\r\n		<p class=\\"visit\\">\r\n			<a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">Klik hier om contact op te nemen.</a>\r\n		</p>\r\n		<br>\r\n	</li>\r\n	\r\n	<li>\r\n		<h1>Seo Panel Plugins</h1> \r\n		<p>\r\n			Voeg <b>Seo plugins</b> toe om uw Seo panel <b>functies uit te breiden</b> volgens uw behoefte. <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">Seo panel plugins</a> worden geleverd door zowel Seo panel als sites van derden. U kunt zelf ook makkelijk Seo plugins <b>ontwikkelen</b> voor Seo Panel. U kunt uw Seo plugin <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">opsturen naar Seo Panel</a> en wij zullen deze vervolgens publiceren op onze website nadat wij deze <b>getest</b> hebben.\r\n			\r\n		</p>		\r\n		<p>\r\n			<a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">Klik hier voor Seo Panel Plugins</a>\r\n		</p>\r\n		<br>\r\n	</li>	\r\n	<li>\r\n		<h1>Contact</h1> \r\n		<p>\r\n			Neem contact met ons op voor eventuele vragen over <b>Seo Panel Tools, Plugins, Functies, etc..</b> met behulp van de onderstaande link.\r\n		</p>		\r\n		<p>\r\n			<a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">Klik hier om contact op te nemen.</a>\r\n		</p>\r\n		<br>\r\n	</li>	\r\n	<li>\r\n		<h1>Support Tickets</h1> \r\n		<p>\r\n			Voor <b>technische Ondersteuning</b> van het Seo Panel Team voor het instellen van <b>Seo Panel tools, plugins en andere functies</b>. Bijvoorbeeld voor het instellen van een Cronjob.\r\n		</p>		\r\n		<p>\r\n			<a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">Klik hier om een support ticket aan te maken.</a>\r\n		</p>\r\n		<br>\r\n	</li>	\r\n	<li>\r\n		<h1>Bugs rapporteren.</h1> \r\n		<p>\r\n		Help ons door <b>bugs</b> te rapporteren van <b>Seo Panel Tools, Plugins en Functies</b> met behulp van onderstaande link. \r\n		\r\n		</p>		\r\n		<p>\r\n			<a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">Klik hier om bugs te rapporteren.</a>\r\n		</p>\r\n		<br>\r\n	</li>	\r\n</ul>\r\n</fieldset>\r\n', '2010-10-26 23:26:53'),
(2051, 'nl', 'support', 'support_cont2', '<fieldset>\r\n<legend>Seo Panel Online Naslag</legend>\r\n<ul class=\\"infobox\\">\r\n		\r\n	<li>\r\n		<h1>Seo Panel Hulp</h1> \r\n		<p>\r\n		U kunt de <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">Seo panel documentatie</a> in de <b>hulp gids</b> vinden, het bevat de <b>documentatie</b> voor de Seo panel tools, plugins en aanverwante functies.\r\n		<br>Het is de beste plek op internet om <b>hulp</b> te krijgen voor Seo panel. We hopen dat u bijdraagt aan de SEO Panel \\"hulp gids\\", indien u fouten vindt of als er zaken ontbreken.\r\n		</p>\r\n		<p>\r\n			<a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">Klik hier om de hulp gids te bekijken.</a>\r\n		</p>\r\n		<br>\r\n	</li>	\r\n	<li>\r\n		<h1>Seo Panel Forum</h1> \r\n		<p>\r\n		De plek om te discussiren over \\''s werelds eerste open source <b>Seo bedieningspaneel</b>. Het is de beste plek om <b>antwoorden</b> te vinden op uw vragen over Seo Panel.\r\n		<br>Ook kunt u uw <b>ervaringen uitwisselen</b> tijdens het gebruik van Seo Panel voor het optimaliseren van uw websites.	          \r\n		</p>		\r\n		<p>\r\n			<a href=\\"<?=SP_FORUM_LINK?>\\" target=\\"_blank\\">Klik hier om naar het Seo Panel Forum te gaan.</a>\r\n		</p>\r\n		<br>\r\n	</li>\r\n</ul>	\r\n</fieldset>', '2010-10-26 23:26:53'),
(2052, 'nl', 'support', 'support_cont3', '<fieldset>\r\n<legend>Doneren voor Seo Panel</legend>\r\n<ul class=\\"infobox\\">		\r\n	<li>\r\n		<h1>Geef een donatie voor de verbetering van - \\''s werelds eerste Open Source Seo Bedieningspaneel.</h1> \r\n		<p>\r\n			<b>Doneer</b> aan Seo Panel om de \\''s werelds eerste Open Source Seo Software te ondersteunen.\r\n			\r\n			We zijn van plan om in de toekomst <b>nieuwe functies</b> toe te voegen en Seo Panel te <b>verbeteren</b>.<br>Alleen met uw steun kunnen we onze doelstellingen bereiken. Indien u vindt dat Seo panel voor u de moeite waard is, draag dan a.u.b. een steentje bij.\r\n			Zodra wij uw donatie hebben ontavngen zullen wij uw naam en website vernoemen op onze <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">donatie pagina</a>.\r\n			\r\n		</p>\r\n		<p>\r\n			<a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">Klik hier om te doneren aan Seo Panel.</a>\r\n		</p>\r\n		<br>\r\n	</li>\r\n</ul>\r\n</fieldset>', '2010-10-26 23:26:53'),
