(2860, 'it', 'support', 'support_cont1', '<fieldset>\r\n<legend>Sistema supporto pannello seo</legend>\r\n<ul class=\\"infobox\\">\r\n    <li>\r\n        <h1>Pacchetto 1000 Directory</h1> \r\n        <p>\r\n            Forniamo un pacchetto di <b>1000 directory gratuite verificate e attive</b>, puoi inserirlo nel tuo pannello seo tramite lo <b>strumento di invio directory</b>.Ti aiuter ad  <b>incrementare i backlink</b> verso il tuo sito web.\r\n        Attualmente l\\''elenco di <span id=\\"result_box\\" lang=\\"it\\"><span title=\\"\\"> 1000  directory viene utilizzato per raccogliere fondi per il <strong>futuro sviluppo</strong> del pannello di seo</span></span>.\r\n        Per avere la lista delle 1000 directory  sufficiente  <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">fare una donazione di </a> $10 o pi per migliorare le caratteristiche del pannello seo.\r\n        Per qualsiasi informazione sulle 1000 directory non esitare a  <a href=\\"<?=SP_CONTACT_LINK?>\\"\r\ntarget=\\"_blank\\">contattarci</a> o ad aprire un ticket sul  <a href=\\"<?=SP_SUPPORT_LINK?>\\"\r\ntarget=\\"_blank\\">forum di supporto</a>.        </p>\r\n    </li>\r\n    \r\n    <li>\r\n      <p>\r\n      <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">Visita questo link per effettuare una donazione per il pannello seo</a></p>\r\n      <br>\r\n    </li>\r\n    <li>\r\n        <h1>Pacchetti modori di ricerca in locale</h1> \r\n        <p>\r\n            Aggiungi i  <b>domini dei motori di ricerca in locale</b> di google,yahoo,msn(<b>es: www.google.de,www.google.fr ecc\r\n</b>) al pannello seo per la  <b>verifica della posizione delle keyword</b>, per tracciare le performance del tuo sito in locale.\r\n            Per ottenere il pacchetto dei motori di ricerca in locale(in base alle tue esigenze) per cortesia <a\r\nhref=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">donae</a> $10 o di pi per migliorare le caratteristiche del pannello seo. Prima di inviare una donazione, per cortesia <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">contattaci</a> per fornirci l\\''elenco dei domini che vuoi richiedere.<br>\r\n<br>              \r\n            Puoi anche aggiungere  <b>nuovi motori di ricerca (es:baidu.com)</b> al tuo pannello seo per la verifica della posizione delle keyword. Per fare questo puoi <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">contattarci</a> o aprire un ticket nel <a\r\nhref=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">sistema di supporto</a>.        </p>        \r\n<p class=\\"visit\\">\r\n            <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">Visita questo link per contattarci</a></p>\r\n      <br>\r\n    </li>\r\n    \r\n    <li>\r\n        <h1>Plugin pannello seo</h1> \r\n  <p>\r\n            Aggiungi <b>plugin seo </b>al tuo pannello seo per  <b>estendere le caratteristiche</b> in base alle tue esigenze.\r\n      <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">I plugin del pannello seo </a>sono realizzati dallo stesso SeoPanel che da terze parti. Puoi anche semplicemente <b>sviluppare</b> i plugin seo per il tuo stesso pannello.Puoi  <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">inviare</a> il tuo plugin seo e noi e provvederemo a  <b>pubblicarlo </b>nel nostro sito web dopo il nostro processo di  <b>verifica</b>.    </p>\r\n    </li>    \r\n    <li>\r\n      <p>\r\n    <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">Visita questo link per prelevare plugin del pannello seo</a></p>\r\n  <br>\r\n    </li>\r\n    <li>\r\n        <h1>Contattaci</h1> \r\n        <p>\r\n      Contattaci per qualsiasi questione riguardante il <b>pannello seo, plugin e caratteristiche ecc</b> utilizzando il link che si presenta di seguito.        </p>        \r\n        <p>\r\n            <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">Visita questo link per contattarci.</a></p>\r\n        <br>\r\n    </li>    \r\n    <li>\r\n        <h1>Ticket di supporto</h1> \r\n        <p>\r\n      Per avere  <b>supporto tecnico </b>dal team del pannello seo per installare gli <b>strumenti del pannello seo, plugin e altre caratteristiche.</b> Es: per configurare la cronologia per la verifica delle posizioni per le keyword.        </p>\r\n    </li>    \r\n    <li>\r\n      <p>\r\n        <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">Visita questo link per creare un ticket di supporto</a></p>\r\n      <br>\r\n    </li>\r\n    <li>\r\n        <h1>Segnala bug</h1> \r\n        <p>\r\n            Riporta i  <b>bug</b> relativi gli <b>strumenti del pannello seo,plugin, caratteristiche ecc</b> utilizzando il seguente link. Per cortesia aiutaci a migliorare tutte le caratteristiche per la prossima versione.        </p>        \r\n        <p>\r\n            <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">Visita questo link per segnalare bug</a></p>\r\n        <br>\r\n    </li>    \r\n</ul>\r\n</fieldset>', '2010-10-26 21:06:28'),
(2861, 'it', 'support', 'support_cont2', '<fieldset>\r\n<legend>Risorse online pannello seo</legend>\r\n<ul class=\\"infobox\\">\r\n        \r\n    <li>\r\n      <h1>Guida di aiuto del pannello seo</h1> \r\n      <p>\r\n            Puoi visualizzare la  <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">documentazione del pannello seo </a> nella<b> guida di aiuto</b>, che contiene la<b> documentazione</b> per gli strumenti del pannello seo, plugin e relative caratteristiche.<br>\r\n          Questo  il miglior posto su internet per  <b>ricevere aiuto</b> circa il pannello seo. Speriamo che tu possa \r\n<b>contribuire</b> per la guida del pannello seo se sono errori o dimenticanze.</p>\r\n        <p>\r\n        <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">Visita la guida di aiuto del pannello seo</a></p>\r\n        <br>\r\n    </li>    \r\n    <li>\r\n        <h1>Forum Pannello Seo</h1> \r\n        <p>\r\n            Un posto dove discutere del primo <b>pannello di controllo seo </b>open source al mondo.          Questo  il posto migliore dove trovare le <b>risposte</b> alle <b>tue domande</b> circa il pannello seo. \r\n            <br>\r\n      Puoi anche <b>condividere</b> la tua  <b>esperienza</b> nell\\''utilizzo del pannello seo per ottimizzare il tuo sito web.      </p>        \r\n        <p>\r\n        <a href=\\"<?=SP_FORUM_LINK?>\\" target=\\"_blank\\">Visita il forum del pannello seo</a></p>\r\n        <br>\r\n  </li>\r\n</ul>    \r\n</fieldset>', '2010-10-26 21:06:28'),
(2862, 'it', 'support', 'support_cont3', '<fieldset>\r\n<legend>Dona al pannello seo</legend>\r\n<ul class=\\"infobox\\">        \r\n  <li>\r\n      <h1>Dona al Pannello Seo - Il primo pannello di controllo seo Open Source al mondo</h1> \r\n        <p>\r\n            <b>Dona</b> al pannello seo per supportare il primo pannello di controllo seo open source al mondo.Abbiamo programmato di  <b>aggiungere e migliorare</b> molte caratteristiche del pannello seo in futuro. \r\n            <br>\r\n            Con il vostro <b>supporto</b> possiamo raggiungere i nostri  <b>obiettivi</b>. <span id=\\"result_box\\" lang=\\"it\\" xml:lang=\\"it\\"><span title=\\"\\">Se ritieni che il pannello seo  fatto<strong> per voi,</strong> fate una donazione al team del pannello seo.<br />\r\n            </span><span title=\\"\\">Noi <strong>pubblicheremo</strong> il vostro nome e informazioni sul sito nella <a href=\\"<?=SP_DONATE_LINK?>\\"\r\ntarget=\\"_blank\\">pagina di donazione</a>, una volta ottenuta.</span></span><br>\r\n        </p>\r\n        <p>\r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">Visita questo link per donare al pannello seo</a></p>\r\n        <br>\r\n  </li>\r\n</ul>\r\n</fieldset>', '2010-10-26 21:06:28'),
