(3204, 'ro', 'home', 'home_cont1', '<h1 style=\\"text-align: center;margin-bottom: 30px;font-size: 19px;\\">Bine ati venit la Seo Panel - Primul panou de control Seo din lume pentru mai multe site-uri web</h1> \r\n        <p> \r\n            Un panou de control seo <b>complet open source</b> pentru managementul <b>optimizarii motoarelor de cautare</b> pentru site-urile dvs..  \r\n            Seo Panel este <b>un kit de unelte seo</b> ce include ultimile unelete seo de pe piata pentru a <b>creste si verifica</b> \r\n<b>performantele</b> site-ului dvs.. \r\n            Este un <b>software gratis</b> lansat sub <b>GNU GENERAL PUBLIC LICENSE</b>. \r\n            Principalul atu al panoului ce control Seo este <b>expandabilitatea</b> prin utilizarea <a href=\\"<?=SP_PLUGINSITE?>\\"\r\ntarget=\\"_blank\\">plugin-urilor seo</a>. \r\n            Oricine poate foarte usor sa <b>dezvolte si sa instaleze</b> plugin-ul necesar nevoilor sale.  \r\n        </p> \r\n        <p></p> \r\n        <p> \r\n            Acest software open source a fost <b>lansat in Ianuarie 2010</b>. \r\n            Cu toate acestea si intr-o <b>periada scurta</b> de timp <b>mii</b> de <b>web masters</b> folosesc acest software\r\npentru <b>optimizarea</b> site-urilor lor. \r\n            Utilizati panoul de control chiar azi si <b>bucurativa</b> de tot ce tine de seo sub o  <b>singura platforma</b>. \r\n        </p>', '2012-05-18 15:27:04'),
(3205, 'ro', 'home', 'home_cont2', '<fieldset> \r\n<legend>Noutati majore ale Panoului de control Seo <?=SP_INSTALLED?></legend> \r\n<ul class=\\"infobox\\"> \r\n    <li>         \r\n        <h1>Unealta de inregistrare automata in directoare</h1> \r\n        <p> \r\n            Unealta de inregistrare automata in directoare ne ajuta sa  <b>inregistram site-urile noastre</b> in majoritatea <b>directoarelor gratis sau cu plata</b>. \r\n            Putem deasemenea sa <b>urmarim statusul</b> fiecarei inregistrari prin <b>verificare periodica</b> utilizand scriptul <b>verificare status</b>. \r\n            <b>Managerul directoare</b> ne va ajuta sa gasim daca <b>un director este activ sau</b> nu. \r\n        </p> \r\n    </li> \r\n    <li>         \r\n        <h1>Verificator pozitionare cuvant cheie</h1> \r\n        <p> \r\n            Verificatorul de cuvinte cheie va gasi  <b>pozitia in motoarele de cautare</b> pentru <b>cuvintele cheie alese</b>\r\npentru site-ul dvs. si le <b>salveaza</b> in sistem. \r\n            In sectiunea pozitionarii cuvintelor cheie, putem vedea <b>pozitionarea zilnica</b> a cuvintelor cheie in diferite motaore de cautare\r\nprin <b>grafice frumoase</b> si <b>rapoarte detaliate</b>. \r\n        </p> \r\n    </li> \r\n    <li>        \r\n        <h1>Evaluator Site</h1>\r\n        <p>Evaluator site va <b>evalua toti factori SEO</b> al fiecarei pagini dintr-un site si va da\r\n<b>raport detaliat</b> inlegatura cu fiecare pagina. Aceasta ne va ajuta sa creem fisiere sitemap <b>XML,HTML,TEXT</b> ale site-urilor noastre pentru a le trimite <b>submit</b> motoarelor de cautare.</p>\r\n    </li> \r\n    <li>         \r\n        <h1>Verificator rank Google si Alexa</h1> \r\n        <p> \r\n           Verificatorul Google si Alexa rank va gasi <b>google pagerank</b> si <b>alexa rank</b> al site-urilor noastre pe care le <b>salveaza</b> in sistem. \r\n            In sectiunea <b>rapoarte rank</b> , putem vedea <b>zilnic</b> google si alexa rank pentru fiecare site prin <b>rapoarte detaliate</b>. \r\n        </p> \r\n    </li> \r\n    <li>         \r\n        <h1>Verificator backlink-uri</h1> \r\n        <p> \r\n            Verifiatorul de backlink-uri va gasi un <b>numar de backlink-uri</b> al site-urilor noastre in diferite motoare de cautare\r\n<b>(google,yahoo,msn etc)</b> si le <b>salveaza</b> in sistem. \r\n            <br>In sectiunea <b>rapoartelor de backlink-uri</b>, putem vedea <b>numarul zilnic de backlink-uri</b> pentru fiecare site web prin <b>rapoarte detaliate</b>. \r\n        </p> \r\n    </li>     \r\n    <li>         \r\n        <h1>Verificator saturatie motoare de cautare</h1> \r\n        <p> \r\n            Verificatorul de saturatie al motoarelor de cutare va gasi <b>numarul paginilor indexate</b> al site-urilor dvs. in diferite motoare de cautare\r\n<b>(google,yahoo,msn etc)</b> si le va <b>salva</b> in sistemm. \r\n            In sectiunea <b>rapoarte verificatoar saturatie motoare de cautare</b> putem vedea <b>numarul paginilor indexate zilnic</b> pentru fiecare site web prin  <b>rapoarte detaliate</b>. \r\n        </p> \r\n    </li> \r\n    <li>         \r\n        <h1>Plugin-uri Panou de control Seo</h1> \r\n        <p> \r\n            Principala <b>caracteristica majora</b> a panoului de control seo este <b>expandabilitatea</b>. \r\n            Adauga <b>pluginuri seo</b> la panoul de control seo pentru a <b>extinde carcteristicile</b> dupa necesitatile dvs.. \r\n            <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">Plugin-urile panoului de control seo</a> Sunt dezvoltate atat de catre echipa seo Panel cat si de site-uri colaboratoare. \r\n            Puteti deasemenea foarte usor sa <b>dezvoltati</b> plugin-uri seo pentru panoul de control Seo al dvs.. \r\n            Puteti <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">trimite</a> pluginul dvs. la seo panel si noi il vom\r\n <b>publica</b> pe site-ul oficial dupa ce va trece printr-un proces de <b>verificare</b>. \r\n        </p> \r\n    </li> \r\n    <li>         \r\n        <h1>generator meta tagu-ri</h1> \r\n        <p> \r\n            Generatorul de meta tag-uri este <b>un plugin pentru</b> crearea<b> de mata tag-uri la comanda(custom)</b> pentru site-ul nostru. \r\n            Ne va ajuta sa dam <b>mai multe informatii</b> despre siteul nostru la <b>bots ale motoarelor de cautare</b>\r\nin timp ce ne urmaresc site-ul. \r\n        </p> \r\n    </li> \r\n</ul> \r\n</fieldset>', '2012-05-18 15:27:04'),
(3206, 'ro', 'home', 'home_cont3', '<fieldset> \r\n<legend>resusre online ale Panoului de control Seo</legend>     \r\n<ul class=\\"infobox\\"> \r\n\r\n    <li> \r\n        <h1>resurse ale panoului de control pentru  Reference</h1>                 \r\n         \r\n         \r\n        <p> \r\n            <a href=\\"http://www.seopanel.in\\" target=\\"_blank\\">Seo Panel Site oficial</a> \r\n        </p> \r\n        <p> \r\n            <a href=\\"<?=SP_DOWNLOAD_LINK?>\\" target=\\"_blank\\">Download Seo Panel</a> \r\n        </p> \r\n         \r\n        <p> \r\n            <a href=\\"<?=SP_DEMO_LINK?>\\" target=\\"_blank\\">Seo Panel Demo</a> \r\n        </p> \r\n         \r\n        <p> \r\n            <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">Conatcteaza Seo Panel</a> \r\n        </p> \r\n         \r\n        <p> \r\n            <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">Seo Panel Ghid ajutor</a> \r\n        </p> \r\n         \r\n        <p> \r\n            <a href=\\"<?=SP_FORUM_LINK?>\\" target=\\"_blank\\">Seo Panel Forum</a> \r\n        </p> \r\n         \r\n        <p> \r\n            <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">Seo Panel Suport de sitem</a> \r\n        </p> \r\n         \r\n        <p> \r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">Donati pentru Seo Panel</a> \r\n        </p> \r\n    </li> \r\n     \r\n</ul> \r\n</fieldset>', '2012-05-18 15:27:04'),
