(3490, 'pt', 'support', 'support_cont1', '<fieldset>\r\n<legend> Seo panel sistema de suporte </legend>\r\n<ul class=\\"infobox\\"> \r\n<li>\r\n<h1> Pacote de 1000 directrios </h1>\r\n<p>\r\nNs estamos fornecendo <b>um pacote de 1000 activos e verificados </b> inseres em directrios da internet, para adicionar no seu Seo panel <b> na ferramenta de submisso de directrios </b>.\r\nVai ajudar voc a aumentar <b> backlinks </b> a visibilidade dos seus sites.\r\nActualmente estamos a angariar<b> uma doaco para futuros desenvolvimentos </b>\r\npara o Seo Panel.\r\nPara obter a lista 1000 directrios <a href = \\"<?=SP_DONATE_LINK?>\\" target = \\"_blank\\"> doe </a>\r\nUS $ 20 ou mais para melhorar as caractersticas do Seo Panel.\r\nSe voc tiver alguma dvida sobre pacote de 1000 do directrios, por favor <a href = \\"<?=SP_CONTACT_LINK?>\\"\r\ntarget ="_blank"> contato nos </a> ou submeta um ticket no <a href = \\"<?=SP_SUPPORT_LINK?>\\"\r\ntarget = \\"_blank\\"> Suporte Sistema </a>.\r\n</P>\r\n<p>\r\n<A href = \\"<?=SP_DONATE_LINK?> \\" Target ="_blank"> Visite este link para doar para seo panel </a>\r\n</P>\r\n<br>\r\n</Li>\r\n\r\n<li>\r\n<h1> Pacote de motores de busca Locais </h1>\r\n<p>\r\nAdicionar <b> motor de busca locais , domnios </b> do google, yahoo, msn (por exemplo, <b>: www.google.de, www.google.fr, etc </b>) para seo panel <b> palavra-chave verifica a posio </b>, para acompanhar a sua perfomance site localmente.\r\nPara obter pacotes de motores de busca locais (de acordo com sua exigncia) <a\r\nhref = \\"<?=SP_DONATE_LINK?>\\" target =\\"_blank \\"> doar </a> US $ 20 ou mais para melhorar as caractersticas de seo panel.\r\nAntes de enviar doaes, por favor <a href = \\"<?=SP_CONTACT_LINK?>\\" Target = \\"_blank\\"> Entre em contato </a> para fornecer-nos o domnio do motor de busca em questo.\r\n<br>\r\nTambm para adicionar <b> novos motores de pesquisa (por exemplo: baidu.com) </b> no seu seo panel e palavras-chave,\r\npor favor <a href = \\"<?=SP_CONTACT_LINK?>\\" target = \\" _blank\\">contato nos </a> ou abrir um ticket no <a\r\nhref = \\"<?=SP_SUPPORT_LINK?>\\" target = \\"_blank\\"> sistema de suporte </a>.\r\n</P>\r\n<p class=\\"visit\\"> \r\n<A href = \\"<?=SP_CONTACT_LINK?>\\" Target = \\"_blank\\"> Visite este link para entrar em contacto connosco </a>\r\n</P>\r\n<br>\r\n</Li>\r\n\r\n<li>\r\n<h1>Seo plugins </h1>\r\n<p>\r\nAdicionar <b> plugins </b> ao seu Seo Panel para <b> estender os recursos </b> de acordo com a sua exigncia.\r\n<A href = \\"<?=SP_PLUGINSITE?>\\" Target = \\"_blank\\"> Seo Panel plugins </a> so fornecidos por Seo Panel e e por terceiros.\r\nVoc tambm pode facilmente desenvolver <b> </b> plugins de SEO para seu painel de seo.\r\nVoc pode <a href = \\"<?=SP_PLUGINSITE?> \\"Target =\\" _blank \\"> apresentar </a> o seu plugin para Seo, Seo Panel vai publicar <b> </b> no nosso site aps testarmos o plugin.\r\n</P>\r\n<p>\r\n<A href = \\"<?=SP_PLUGINSITE?>\\" Target = \\"_blank\\"> Visite este link para obter os plugins para o Seo Panel </a>\r\n</P>\r\n<br>\r\n</Li>\r\n<li>\r\n<h1>Fale Connosco </h1>\r\n<p>\r\nEntre em contacto connosco para esclarecer qualquer dvida sobre as ferramentas de  <b>Seo Panel, plugins e funcionalidades etc </b> usando o link abaixo.\r\n</P>\r\n<p>\r\n<A href = \\"<?=SP_CONTACT_LINK?>\\" Target = \\"_blank\\"> Visite este link para contacto connosco </a>\r\n</P>\r\n<br>\r\n</Li>\r\n<li>\r\n <h1>Tickets de Suporte </h1>\r\n<p>\r\nPara obter suporte tcnico <b> </b> da equipe do Seo Panel para configurar as ferramentas do <b>Seo Panel, plugins e\r\nrecursos </b> Por exemplo:. Para configurar o cron para verificador de posio da palavra-chave.\r\n</P>\r\n<p>\r\n<A href = \\"<?=SP_SUPPORT_LINK?>\\" Target = \\"_blank\\"> Visite este link para criar um ticket de suporte </a>\r\n</P>\r\n<br>\r\n</Li>\r\n<li>\r\n<h1>Relatar bugs </h1> \r\n<p>\r\nRelatrio de  <b> bugs </b> sobre ferramentas do <b> Seo painel, plugins e funcionalidades etc </b> usando o link abaixo.\r\npor favor, ajude-nos a melhorar as caractersticas das verses vindouras.\r\n</P>\r\n<p>\r\n<A href = \\"<?=SP_SUPPORT_LINK?> \\"Target =\\"_blank\\"> Visite este link para relatar bugs </a>\r\n</P>\r\n<br>\r\n</Li>\r\n</Ul>\r\n</Fieldset> ', '2010-11-17 20:51:31'),
(3491, 'pt', 'support', 'support_cont2', '<fieldset>\r\n<legend>  Recursos on-line do Seo Panel </legend>\r\n<ul class=\\"infobox\\"> \r\n\r\n<li>\r\n<h1>Guia de Ajuda do Seo Panel</h1>\r\n<p>\r\nVoc pode ver a <a href = \\"<?=SP_HELP_LINK?>\\" Target = \\"_blank\\"> documentao de ajuda</A> do Seo Panel , que contm documentos dos recursos para as ferramentas do SEO Panel, plugins e afins.\r\n<br>  o melhor lugar na internet para <b> obter ajuda </b> sobre SEO Panel. Esperamos que voc<b> possa contribuir </b> para o guia de ajuda do Seo Panel , caso voc encontre erros ou coisas que faltam.\r\n</P>\r\n<p>\r\n<A href = \\"<?=SP_HELP_LINK?>\\" Target = \\"_blank\\"> Visite o guia de ajuda do Seo Panel </A>\r\n</P>\r\n<br>\r\n</Li>\r\n<li>\r\n<h1> Frum do Seo Panel </h1>\r\n<p>\r\nUm lugar para discutir sobre a primeiro software livre do mundo de <b> controle de Seo</b>.\r\n o melhor local para encontrar as respostas para <b>as suas perguntas </b> sobre SEO Panel.\r\n<br> Tambm voc pode <b> partilhar</b> a sua experincia <b></B>, enquanto usa o SEO Panel para optimizar os seus sites.\r\n</P>\r\n<p>\r\n<A href = \\"<?=SP_FORUM_LINK?>\\" Target = \\"_blank\\"> Visite Frum do Seo Panel </a>\r\n</P>\r\n<br>\r\n</Li>\r\n</Ul>\r\n</Fieldset> ', '2010-11-17 20:51:31'),
(3492, 'pt', 'support', 'support_cont3', '<fieldset>\r\n<legend> Doaes para Seo Panel </legend>\r\n<ul class=\\"infobox\\"> \r\n<li>\r\n<h1> Doaes para Seo Panel - Primeiro software livre de controle Seo do mundo </h1>\r\n<p>\r\n<b> Doe </b> para o suporte do Seo Panel, o primeiro Seo de cdigo aberto do mundo.\r\nEstamos planear <b> acrescentar e melhorar </b> caractersticas do Seo Panel no futuro.\r\n<br> S com o seu apoio  ns podemos alcanar nossos objectivos.\r\nSe voc acha que o Seo Panel preenche os <b>requisitos</b>, por favor doe alguma quantia para a equipa do Seo Panel.\r\n<br> Vamos <b> publicar </b> seu nome e informaes do seu site <a href = \\"<?=SP_DONATE_LINK?>\\"\r\ntarget = \\"_blank\\"> pgina de doaes </a>, quando recebermos a sua doao.\r\n</P>\r\n<p>\r\n<A href = \\"<?=SP_DONATE_LINK?>\\" Target = \\"_blank\\"> Visite este link para doar para seo painel </a>\r\n</P>\r\n<br>\r\n</Li>\r\n</Ul>\r\n</Fieldset> ', '2010-11-17 20:51:31'),
