(3640, 'tr', 'home', 'home_cont1', '<h1 style=\\"text-align: center;margin-bottom: 30px;font-size: 19px;\\">Seo Panel\\''e Hogeldiniz - En ok\r\ntercih edilen bir ok sitenin seo paneli</h1>\r\n        <p>\r\n            sitenizin <b>arama motoru optimizasyonu</b> kontrolu iin tamamen <b>ak kaynak kodlu seo</b>\r\n<b>kontrol paneli</b>\r\n\r\n            Seo Panel bir <b>seo aracdr</b> ve sitenizin <b>hitini ve performansn arttrmak</b> iin en son\r\n aralara sahip.\r\n            <b>cretsiz</b> bir software ve <b>GNU GENERAL PUBLIC LICENSE</b>\\''a sahiptir.\r\n            Seo panelin ana zellii <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">seo pluginler</a>\r\nkullanarak <b>geniletilebilirlii</b>\r\n.\r\n            Herkes kolayca kendi gerekli seo pluginleri <b>gelitirebilir ve ykleyebilir</b>. \r\n        </p>\r\n        <p></p>\r\n        <p>\r\n            Bu open source software <b>yaym tarihi Ocak 2010</b>.\r\n            Bu <b>ksa srede binlerce webmaster</b> bu software\\''i kullanarak sitelerini optimize ediyor.\r\n            Bugn <b>tek bir platform</b> altnda seo paneli kullann.\r\n        </p>', '2011-07-14 21:55:54'),
(3641, 'tr', 'home', 'home_cont2', '<fieldset>\r\n<legend>Seo Panel Ana zellikleri<?=SP_INSTALLED?></legend>\r\n<ul class=\\"infobox\\">\r\n    <li>        \r\n        <h1>Automatik Directory Ekleme Arac</h1>\r\n        <p>\r\n            Automatik directory ekleme arac bize <b>sitelerimizi</b> cretli ya da cretsiz ana internet rehberlerine\r\neklememize yardmc olur.\r\n            Hatta <b>statu kontrol script</b>i ile herbir rehbere ekli siteyi kontrol edebiliriz.\r\n            <b>Directory yneticisi</b> aktif olsada olmasada bize bulmamzda yardmc olur.\r\n        </p>\r\n    </li>\r\n    <li>        \r\n        <h1>Anahtar kelime (keyword) Pozisyon Kontrol</h1>\r\n        <p>\r\n            Anahtar kelime pozisyon kontrolu sayesinde sistemdeki sitenize ait <b>hedef kelimenin arama motorundaki pozisyonunu</b>\r\nkontrol edebilir ve kaydedebilirsiniz.\r\n            Anahtar kelime pozisyon blmnde, ayrntl raporlar ile grafikli farkl arama motorlarndaki analizleri grebiliriz.\r\n        </p>\r\n    </li>\r\n    <li>        \r\n        <h1>Site Denetisi</h1>\r\n        <p>Site Denetisi bir siteye ait her bir sayfadaki <b>tm seo faktrlerini denetlicek</b> ve hersayfa hakknda\r\n<b>detayl rapor vericek</b>. Buda <b>XML,HTML,TEXT</b> arama motorlarna gnderilecek sitenizin sitemap dosyasn\r\noluturmaya yardmc olacak.</p>\r\n    </li>\r\n    <li>        \r\n        <h1>Google ve Alexa Rank Kontrol</h1>\r\n        <p>\r\n            Google ve alexa rank kontrolu websitenizin <b>google pagerank</b> ve <b>alexa rank</b>ini bulur\r\nve sistem iine <b>kayt</b> eder.\r\n            <b>Rank raporlar</b> blmnde, <b>gnlk</b> google ve alexa rank\\''lerini <b>detayl raporlarla</b> grebiliriz.\r\n        </p>\r\n    </li>\r\n    <li>        \r\n        <h1>Backlink Kontrol</h1>\r\n        <p>\r\n            Backlinks Kontrol arama mototlarnda (<b>google,yahoo,msn</b> etc) <b>backlinklerin saysn</b> bulur ve sisteme kayt eder.\r\n            <br><b>Backlink raporlar</b> blmnde, detayl raporlar ile birlikte herbir siteye ait <b>gnlk backlink saylar</b> bulunur.\r\n        </p>\r\n    </li>    \r\n    <li>        \r\n        <h1>Arama Motoru ndex Kontrol</h1>\r\n        <p>\r\n            Arama Motoru ndex Kontrol farkl arama motorlarna (<b>google,yahoo,msn</b> etc) ait <b>indexlenmi\r\nsayfalarn saysn</b> gsteririr ve sisteme kaydeder.\r\n            <b>Arama Motoru ndex Kontrol raporlar</b> bmnde, detayl raporlar ile herbir siteye ait\r\n<b>gnlk indexli sayfa saysn</b>gsterir.\r\n        </p>\r\n    </li>\r\n    <li>        \r\n        <h1>Seo Panel Pluginleri</h1>\r\n        <p>\r\n            Seo Panalin <b>ana zellii</b> <b>geniletilebilirlii</b>.\r\n            <b>Seo pluginleri</b>size gerekli olanlar ercevesinde zelliklerinizi gelitirmek iin kendi panelinize eleyin.\r\n            <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">Seo panel pluginler</a> seo panel ve\r\nnc parti yazlmlar destekler.\r\n            Seo pluginleri seo panel iin kolayca <b>gelitirebilirsiniz</b>.\r\n            Seo pluginleri seo panelinize <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">ekleyebilirsiniz</a> ve\r\nBiz gzden geirme prosesinden sonra kendi sitemizde <b>yaynlarz</b>.\r\n        </p>\r\n    </li>\r\n    <li>        \r\n        <h1>Meta Tag Oluturucu</h1>\r\n        <p>\r\n            Meta tag Oluturucu sitemize meta tagler oluturmak iin bir <b>seo panel pluginidir</b>.\r\n            Arama motorlar <b>botlar</b> sitemizi listelerken daha fazla bilgi alabilmeri iin yardmc olur.\r\n        </p>\r\n    </li>\r\n</ul>\r\n</fieldset>', '2011-07-14 21:55:54'),
(3642, 'tr', 'home', 'home_cont3', '<fieldset>\r\n<legend>Seo Panel Online Kaynaklar</legend>    \r\n<ul class=\\"infobox\\">\r\n\r\n    <li>\r\n        <h1>Seo Panel Online Kaynaklar</h1>                \r\n        \r\n        \r\n        <p>\r\n            <a href=\\"http://www.seopanel.in\\" target=\\"_blank\\">Seo Panel Resmi Site</a>\r\n        </p>\r\n        <p>\r\n            <a href=\\"<?=SP_DOWNLOAD_LINK?>\\" target=\\"_blank\\">Seo Panel ndir</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_DEMO_LINK?>\\" target=\\"_blank\\">Seo Panel Demo</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">Seo Panel letiim</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">Seo Panel Yardm</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_FORUM_LINK?>\\" target=\\"_blank\\">Seo Panel Forum</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">Seo Panel Destek Sistemi</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">Seo Panel\\''e Ba Yap</a>\r\n        </p>\r\n    </li>\r\n    \r\n</ul>\r\n</fieldset>', '2011-07-14 21:55:54'),
