(4262, 'da', 'home', 'home_cont1', '<h1 style="text-align: center;margin-bottom: 30px; font-size: 19px;">Velkommen til Seo Panels - Verdens frste seo kontrolpanel til websteder</h1>\r\n<p> \r\nEn komplet <b> open source seo kontrolpanel</b> for at redigere sgemaskine optimering </b> af dine websites.\r\nSeo Panel er et <b> seo vrktj</b> inkludere det nyeste seo vrktjer for at <b> forge og spore </b> ydelsen af dine websteder.\r\ndet er <b> gratis software</b> udgivet under <b>GNU GENERAL PUBLIC LICENSE</b>\r\nhoved vrktjet i seo panel er <b>udvidelses</b> mulighederne ved at bruge <a href ="<?=SP_PLUGINSITE?>"target="_blank">seo plugins</a>.\r\nMan kan nemt <b>udvikle og installere</b> de ndvendige plugins i ens seo panel\r\n</p>\r\n<p></p>\r\n<p>\r\nDet er et open-source software som er <b>udgivet i januar 2010</b>\r\nMed denne korte periode af tid, har tusinder af webmasters brugt denne software til at optimere deres hjemmeside. Brug seo panel i dag og <b> nyd</b> at alt seo er under <b>en platform</b>\r\n\r\n</p>\r\n\r\n ', '2014-01-20 03:26:43'),
(4263, 'da', 'home', 'home_cont2', '', '2014-01-20 03:26:43'),
