(6665, 'tr', 'support', 'support_cont1', '<fieldset>\r\n<legend>Seo Panel Destek Sistemi</legend>\r\n<ul class=\\"infobox\\">\r\n    <li>\r\n        <h1>1000 Directory (Link Listesi - Rehber) Paketi</h1> \r\n        <p>\r\n            Biz <b>1000 cretsiz ve onayl</b> link listesi paketi salyoruz , seo panelinize\r\neklemek iin <b>directory ekleme arac</b>.\r\n            Bu websitenize ait <b>backlinklerinizi</b> arttracak.\r\n            Aslnda 1000 directory link listesi seo panel zelliklerini gelistirmek iin gerekli tutar\r\nkarlayabilmek iin <b>tantld</b>\r\n</b>.\r\n            1000 directory link listesini almak iin ltfen seo paneli gelitirebilmemiz iin<a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">ba\r\nyapnz</a>. $10 veya daha fazla.\r\n            Eer 1000 directory paketi hakknda sorunuz varsa, ltfen <a href=\\"<?=SP_CONTACT_LINK?>\\"\r\ntarget=\\"_blank\\">bizimle irtibata geiniz</a> ya da <a href=\\"<?=SP_SUPPORT_LINK?>\\"\r\ntarget=\\"_blank\\">destek sisteminden</a> bir konu anz.   \r\n        </p>        \r\n        <p>\r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">Seo Panel\\''e Ba Yap Sayfas</a>\r\n        </p>\r\n        <br>\r\n    </li>\r\n    \r\n    <li>\r\n        <h1>Yerel Arama Motoru Paketi</h1> \r\n        <p>\r\n            lkenize ait<b>yerel arama motoru</b> linklerini seo panele giriniz rnek; google,yahoo,msn(<b>eg: www.google.de,www.google.fr\r\ngibi</b>) ve <b>Anahtar kelimeleri</b> yerel sitenizin performansn grmek iin ekleyiniz.\r\n            htiyalarnza bal seo paketi almak iin ltfen seo paneli gelitirebilmemiz iin<a\r\nhref=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">ba yapnz</a> $10 veya daha fazla.\r\n            Ba gndermeden nce, ltfen hangi domain iin bavurduunuzu bildirmek iin\r\n<a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">bizimle iletiime gein.</a>\r\n            <br><br>              \r\n            Ayrca seo panelinize anahtar kelime kontrolu iin <b>yeni bir arama motoru(eg:baidu.com)</b> eklemeden nce,\r\nltfen <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">bizimle iletiime</a> gein ya da <a\r\nhref=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">destek sisteminde</a> bir konu an. \r\n        </p>        \r\n        <p class=\\"visit\\">\r\n            <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">letiim Sayfasn Ziyaret Edin</a>\r\n        </p>\r\n        <br>\r\n    </li>\r\n    \r\n    <li>\r\n        <h1>Seo Panel Pluginleri</h1> \r\n        <p>\r\n            htiyalarnza gre seo panelinizi gelitirmek iin <b>seo pluginler</b> ekleyin.\r\n            <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">Seo panel pluginler</a> hem seo panel hemde nc parti\r\nsiteleri desteklemektedir.\r\n            Seo panel pluginleri kendi seo paneliniz iin kolayca <b>gelitirebilirsiniz</b>.\r\n            Kendi pluginlerinizi seo panenle <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">gnderebilirsiniz</a> ve\r\nBiz <b>inceledikten</b> sonra <b>paylarz</b>.        \r\n        </p>        \r\n        <p>\r\n            <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">Seo Panel Plugin Edinmek in Tklaynz</a>\r\n        </p>\r\n        <br>\r\n    </li>    \r\n    <li>\r\n        <h1>letiim</h1> \r\n        <p>\r\n           <b>seo panel aralar, pluginleri veya herhangi bir konu hakknda bir sorunuz olduunda aadaki linkten\r\nbizimle iletiime geebilirsiniz</b>\r\n        </p>        \r\n        <p>\r\n            <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">letiim Sayfas</a>\r\n        </p>\r\n        <br>\r\n    </li>    \r\n    <li>\r\n        <h1>Destek Konusu</h1> \r\n        <p>\r\n            seo panel aralar, pluginleri veya herhangi bir konu hakknda <b>teknik destek</b>\r\nalmak iin konu anz</b>. rnek: anahtar kelime kontrol ayarlar hatas.\r\n        </p>        \r\n        <p>\r\n            <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">Destek Konusu Amak iin Tklaynz</a>\r\n        </p>\r\n        <br>\r\n    </li>    \r\n    <li>\r\n        <h1>Buglar- Hatalar Rapor Et</h1> \r\n        <p>\r\n           Ltfen bir sonraki versiyonda hatalar dzelmek iin bize destek olun ve\r\n           buglar-hatalar bize bilidirin.          \r\n        </p>        \r\n        <p>\r\n            <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">Hata Bildirme Sayfas iin Tkla</a>\r\n        </p>\r\n        <br>\r\n    </li>    \r\n</ul>\r\n</fieldset>', '2011-07-15 09:33:36'),
(6666, 'tr', 'support', 'support_cont2', '<fieldset>\r\n<legend>Seo Panel Online Kaynaklar</legend>\r\n<ul class=\\"infobox\\">\r\n        \r\n    <li>\r\n        <h1>Seo Panel Yardm Rehberi</h1> \r\n        <p>\r\n            Seo Panel kullanm <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">dkman</a>,\r\nierisinde seo panel iin aralar, pluginler ve ilikili konular var.\r\n            <br><b>Yardm almak</b> iin internettiki en iyi seo panel yardm rehberidir. md ederizki\r\nseo panel hakknda unuttuumuz ya da kardmz bir konu hakknda katkda bulunursunuz.                \r\n        </p>\r\n        <p>\r\n            <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">Seo Panel Yardm Rehberi Ziyaret Edin</a>\r\n        </p>\r\n        <br>\r\n    </li>    \r\n    <li>\r\n        <h1>Seo Panel Forum</h1> \r\n        <p>\r\n            Dnyann ilk open source </b>seo paneli</b> hakknda tartmalar yardmlar. \r\n            Seo panel hakknda <b>sorularnza</b> en iyi <b>cevaplar</b> bulabileceiniz tek yer. \r\n            <br>sitenize arama motoru optimizasyonu yaparken seo panel <b>tecrbelerinizide</b>\r\npaylaabilirsiniz..                               \r\n        </p>        \r\n        <p>\r\n            <a href=\\"<?=SP_FORUM_LINK?>\\" target=\\"_blank\\">Seo panel forumu ziyaret edin</a>\r\n        </p>\r\n        <br>\r\n    </li>\r\n</ul>    \r\n</fieldset>', '2011-07-15 09:33:36'),
(6667, 'tr', 'support', 'support_cont3', '<fieldset>\r\n<legend>Seo Panel\\''e Ba</legend>\r\n<ul class=\\"infobox\\">        \r\n    <li>\r\n        <h1>Seo Panel\\''e Ba Yap - Dnyadaki ilk open source seo kontrol paneli</h1> \r\n        <p>\r\n            <b>Ba yaparak</b>dnyadaki ilk open source seo kontrol paneline destek olun.\r\n            Seo panele yeni zellikler <b>eklemeyi ve gelitirmyi</b> planlyoruz. \r\n            <br>Sadece sizin <b>desteinizle</b> hedeflerimizi gerekletirebiliriz.\r\n            Eer seo panel sizin iin de <b>deer kazandrc</b> ise, ltfen seo panel iin ba yapn.\r\n            <br>sminiz ve site bilgilerinizi ba aldktan sonra <a href=\\"<?=SP_DONATE_LINK?>\\"\r\ntarget=\\"_blank\\">Ba Sayfasnda</a> <b>yaynlyacaz</b>.\r\n        </p>\r\n        <p>\r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">Ba Yapmak iin Tklaynz</a>\r\n        </p>\r\n        <br>\r\n    </li>\r\n</ul>\r\n</fieldset>', '2011-07-15 09:33:36'),
