(7389, 'vn', 'home', 'home_cont1', '<h1 style=\\"text-align: center;margin-bottom: 30px;font-size: 19px;\\">Cho mng bn n vi Seo Panel - Bng iu khin seo cho nhiu trang web u tin trn th gii</h1> \r\n\r\n<p> \r\n            Mt <b>m ngun m qun l ti u</b> cho vic qun l <b>cng vic ti u ha trn cng c tm kim</b> cho cc trang web ca bn.  \r\n            Seo Panel l <b>mt b cng c seo</b> bao gm cc cng c seo mi nht <b>lm tng v theo di</b> <b>hiu sut</b> hot ng cc trang web ca bn.\r\ny l mt <b>phn mm min ph</b> tun theo giy php ca <b>GNU GENERAL PUBLIC LICENSE</b>.\r\n\r\nChc nng c bit chnh ca seo panel l s <b>m rng chc ng</b> bng cch s dng <a href=\\"<?=SP_PLUGINSITE?>\\"\r\ntarget=\\"_blank\\">seo plugins</a>. \r\nBt k ai cng c th d dng <b>ci t v pht trin</b> nhng plugin mi cho seo panel ca h.\r\nPhn mm ny chnh thc pht hnh vo <b>Thng 1 nm 2010</b>.\r\nCh trong khong <b>thi gian ngn hng ngn ch web </b>ang s dng phn mm ny  <b>ti u ha</b> trang web ca h.\r\nS dng chnh seo panel ngy hm nay v tn hng tt c mi th lin quan n seo theo <b>mt nn tng n gin nht</b>.\r\n        </p>', '2012-02-02 16:33:54'),
(7390, 'vn', 'home', 'home_cont2', '<fieldset>\r\n<legend> chnh tnh nng ca Seo panel <?=SP_INSTALLED?> </legend>\r\n<ul class=\\"infobox\\">\r\n    <li>\r\n        <h1> t ng th mc thng tin Cng c </h1>\r\n        <p>\r\n            Dung bi vit cng c t ng gip chng ti <b> trnh cc trang web ca chng ti </b> vo chnh <b> min ph\r\nv th mc internet tr tin </b>.\r\n            Chng ti cng c th <b> theo di tnh trng </b> ca mi submit qua kim tra nh k <b> </b> s dng\r\ntnh trng <b> trnh kim tra kch bn </b>.\r\n            <b> qun l th mc </b> s gip chng ti  tm hiu xem <b> th mc ang hot ng </b> hay khng.\r\n        </p>\r\n    </li>\r\n    <li>\r\n        <h1> Checker t kho V tr </h1>\r\n        <p>\r\n            T kho kim tra v tr s tm v tr cng c tm kim <b> </b> <b> t kho c nhm mc tiu </b>\r\ntrang web ca bn v cc ca hng <b> </b> trong h thng.\r\n            Trong phn bo co v tr t kho, chng ta c th thy cc v tr hng ngy <b> </b> ca t kha trong\r\ncng c tm kim khc nhau bng cc  th <b> p </b> v <b> chi tit bo co </b>.\r\n        </p>\r\n    </li>\r\n    <li>\r\n        <h1> Site Kim ton </h1>\r\n        <p>Kim ton Site <b> s kim ton tt c cc yu t SEO </b> ca mi trang ca mt trang web v s cung cp cho mt\r\n<b> bo co chi tit </b> v mi trang. iu ny s gip chng ti  to ra <b> XML, HTML, vn bn </b> sitemap\r\ncc tp tin ca trang web ca chng ti cho <b> trnh </b>  cng c tm kim </p>\r\n    </li>\r\n    <li>\r\n        <h1> Google v Alexa Rank Checker </h1>\r\n        <p>\r\n            Google v alexa xp hng kim tra s tm thy <b> google pagerank </b> v <b> alexa xp hng </b> ca chng ti\r\ntrang web v cc ca hng <b> </b> trong h thng.\r\n            Trong bo co xp hng <b> </b>, chng ta c th thy <b> hng ngy </b> google v xp hng alexa ca mi trang web\r\nbi <b> bo co chi tit </b>.\r\n        </p>\r\n    </li>\r\n    <li>\r\n        <h1> Backlinks Checker </h1>\r\n        <p>\r\n            Backlinks kim tra s tm thy s <b> backlinks </b> ca trang web ca chng ti trong tm kim khc nhau\r\n<b> ng c (google, yahoo, msn ...) </b> v <b> ca hng </b> n trong h thng.\r\n            - Trong bo co backlink <b> </b>, chng ta c th nhn thy <b> hng ngy backlinks tnh </b> ca mi\r\ntrang web bng cch bo co <b> chi tit </b>.\r\n        </p>\r\n    </li>\r\n    <li>\r\n        <h1> Search Engine Saturation Checker </h1>\r\n        <p>\r\n            Search Engine Saturation kim tra s tm thy s <b> ca cc trang c lp ch mc </b> ca trang web ca chng ti\r\ncng c tm kim khc nhau <b> (google, yahoo, msn ...) </b> v <b> ca hng </b> n trong h thng.\r\n            <b> Tm kim cng c kim tra  bo ha bo co </b>, chng ta c th thy trang <b> hng ngy lp ch mc\r\ntnh </b> ca mi trang web bng cch bo co chi tit <b> </b>.\r\n        </p>\r\n    </li>\r\n    <li>\r\n        <h1> Seo Panel Plugins </h1>\r\n        <p>\r\n            Cc tnh nng chnh <b> </b> ca Seo bng iu khin <b> ca n extentability </b>.\r\n            Thm <b> seo plugin </b> vo bng seo ca bn  <b> m rng cc tnh nng </b> theo ca bn\r\nyu cu.\r\n            <A href =\\"<?=SP_PLUGINSITE?>\\" Target=\\"_blank \\"> Seo bng iu khin b sung </a> c cung cp bi c hai bng iu khin seo\r\nv cc trang web ca bn th ba.\r\n            Bn cng c th d dng <b> pht trin </b> seo plugin cho bng iu khin seo ca bn.\r\n            Bn c th <a href =\\"<?=SP_PLUGINSITE?>\\" Target=\\"_blank \\"> trnh </a> Plugin seo seo bng v\r\nchng ti <b> s cng b </b> n trong trang web ca chng ti sau khi xem xt <b> ca chng ti </b> qu trnh.\r\n        </p>\r\n    </li>\r\n    <li>\r\n        <h1> Meta Tag Generator </h1>\r\n        <p>\r\n            Meta t kha my pht in l mt <b> plugin seo bng iu khin </b>  to ra cc th meta <b> ty chnh </b> cho\r\ntrang web.\r\n            N s gip chng ti  cung cp thng tin <b> hn </b> v trang web ca chng ti  chng trnh <b> cng c tm kim </b>\r\ntrong khi h thu thp d liu trang web ca chng ti.\r\n        </p>\r\n    </li>\r\n</ul>\r\n</fieldset>', '2012-02-02 16:33:54'),
(7391, 'vn', 'home', 'home_cont3', '<fieldset>\r\n<legend>H thng Seo Panel trc tuyn</legend>    \r\n<ul class=\\"infobox\\">\r\n\r\n    <li>\r\n        <h1>Bng iu chnh Ti nguyn Seo trc tuyn dnh cho vc tham kho</h1>                \r\n        \r\n        \r\n        <p>\r\n            <a href=\\"http://www.seopanel.in\\" target=\\"_blank\\">a ch chnh thc ca Seo Panel</a>\r\n        </p>\r\n        <p>\r\n            <a href=\\"<?=SP_DOWNLOAD_LINK?>\\" target=\\"_blank\\">Ti Seo Panel</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_DEMO_LINK?>\\" target=\\"_blank\\">Seo Panel Demo</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">Lin h vi tc gi Seo Panel</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">H tr s dng Seo Panel</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_FORUM_LINK?>\\" target=\\"_blank\\">Din n Seo Panel</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\"> H thng h tr Seo Panel</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">Quyn gp Seo Panel</a>\r\n        </p>\r\n    </li>\r\n    \r\n</ul>\r\n</fieldset>', '2012-02-02 16:33:54'),
