(7400, 'es-ar', 'home', 'home_cont1', '<h1 style="text-align: center;margin-bottom: 30px;font-size: 19px;">Bienvenido a SEO PANEL - el primer\r\npanel de control SEO para multiples sitios</h1> \r\n        <p> \r\n            Un completo <b>panel de control SEP de codigo abierto</b> para administrar <b>la optimizacion de los buscadores</b> para sus sitios web.  \r\n            Seo Panel es un <b>recurso SEO</b> que incluye las ultimas herramientas seo para <b>incrementar y seguir</b> la\r\n<b>performace</b> de sus sitios web. \r\n            Es un <b>software libre</b> distribuido bajo <b>GNU GENERAL PUBLIC LICENSE</b>. \r\n            La caracteristica principal de SEO PANEL es su <b>escalabilidad</b> a traves de <a href="<?=SP_PLUGINSITE?>"\r\ntarget="_blank"> plugins SEO</a>. \r\n            Cualquiera puede facilmente <b>desarrollar e instalar</b> los plugins necesarios en su SEO PANEL.  \r\n        </p> \r\n        <p></p> \r\n        <p> \r\n            Este software abierto fue liberado <b>en Enero 2010</b>. \r\n            En este <b>corto periodo</b> de tiempo <b>miles</b> de <b>web masters</b> estan utilizando el software para <b>optimizar</b> sus websites. \r\n            Utilice seo panel hoy y <b>disfrute</b> de todo lo relacionado con SEO dentro de una <b>unica plataforma</b>. \r\n        </p>', '2014-01-06 13:53:36'),
(7401, 'es-ar', 'home', 'home_cont2', '<fieldset> \r\n<legend>Caracteristicas Pricipales de Seo Panel <?=SP_INSTALLED?></legend> \r\n<ul class="infobox"> \r\n    <li>         \r\n        <h1>Herramienta de Envio de Directorios Automatizada</h1> \r\n        <p> \r\n            La Herramienta Automatizada de Envio de Directorios nos auda a <b>enviar nuestros sitios web</b> a los principales <b> directorios de internet gratuitos y dolorosos</b>. \r\n            Podemos tambien <b>seguir el estado</b> de cada envio a traves de  <b>controles periodicos</b> usando <b>el script de control de estado</b>. \r\n            <b>El administrador de directorios</b> nos ayudara a encontrar si un <b>directorio esta activo</b> o no. \r\n        </p> \r\n    </li> \r\n    <li>         \r\n        <h1>Verificador de posicion de palabras clave</h1> \r\n        <p> \r\n            Keyword position checker will find the <b>search engine position</b> of <b>targetted keywords</b>\r\nof your website and <b>stores</b> it in the system. \r\n            In keyword position reports section, we can see the <b>daily positions</b> of keywords in\r\ndifferent search engines by <b>beautiful graphs</b> and <b>detailed reports</b>. \r\n        </p> \r\n    </li> \r\n    <li>         \r\n        <h1>Site Auditor</h1> \r\n        <p>Site Auditor will <b>audit all SEO factors</b> of each pages of a site and will give a\r\n<b>detailed report</b> about each page. This will help us to create <b>XML,HTML,TEXT</b> sitemap\r\nfiles of our website for <b>submit</b> to search engines.</p> \r\n    </li> \r\n    <li>         \r\n        <h1>Google and Alexa Rank Checker</h1> \r\n        <p> \r\n            Google and alexa rank checker will find <b>google pagerank</b> and <b>alexa rank</b> of our\r\nwebsites and <b>stores</b> it in the system. \r\n            In <b>rank reports</b> section, we can see the <b>daily</b> google and alexa rank of each website\r\nby <b>detailed reports</b>. \r\n        </p> \r\n    </li> \r\n    <li>         \r\n        <h1>Backlinks Checker</h1> \r\n        <p> \r\n            Backlinks checker will find <b>number of backlinks</b> of our websites in different search\r\nengines<b>(google,yahoo,msn etc)</b> and <b>stores</b> it in the system. \r\n            <br>In <b>backlink reports</b> section, we can see the <b>daily backlinks count</b> of each\r\nwebsite by <b>detailed reports</b>. \r\n        </p> \r\n    </li>     \r\n    <li>         \r\n        <h1>Search Engine Saturation Checker</h1> \r\n        <p> \r\n            Search Engine Saturation checker will find <b>number of indexed pages</b> of our websites in\r\ndifferent search engines<b>(google,yahoo,msn etc)</b> and <b>stores</b> it in the system. \r\n            In <b>search engine saturation checker reports</b> section, we can see the <b>daily indexed page\r\ncount</b> of each website by <b>detailed reports</b>. \r\n        </p> \r\n    </li> \r\n    <li>         \r\n        <h1>Seo Panel Plugins</h1> \r\n        <p> \r\n            The <b>major feature</b> of seo control panel is its <b>extentability</b>. \r\n            Add <b>seo plugins</b> to your seo panel to <b>extend the features</b> according to your\r\nrequirement. \r\n            <a href="<?=SP_PLUGINSITE?>" target="_blank">Seo panel plugins</a> are provided by both seo panel\r\nand third party sites. \r\n            You can also easily <b>develop</b> seo plugins for your seo panel. \r\n            You can <a href="<?=SP_PLUGINSITE?>" target="_blank">submit</a> your seo plugin to seo panel and\r\nwe will <b>publish</b> it in our website after our <b>review</b> process. \r\n        </p> \r\n    </li> \r\n    <li>         \r\n        <h1>Meta Tag Generator</h1> \r\n        <p> \r\n            Meta tag generator is a <b>seo panel plugin</b> for creating <b>custom meta tags</b> for our\r\nsite. \r\n            It will help us to give <b>more information</b> about our website to <b>search engine bots</b>\r\nwhile they crawl our website. \r\n        </p> \r\n    </li> \r\n</ul> \r\n</fieldset>', '2014-01-06 13:53:36'),
(7402, 'es-ar', 'home', 'home_cont3', '<fieldset> \r\n<legend>Recursos On Line de SEO PANEL</legend>     \r\n<ul class="infobox"> \r\n\r\n    <li> \r\n        <h1>Recursos On Line de SEO PANEL</h1>                 \r\n         \r\n         \r\n        <p> \r\n            <a href="http://www.seopanel.in" target="_blank">Sitio Oficial SEO PANEL</a> \r\n        </p> \r\n        <p> \r\n            <a href="<?=SP_DOWNLOAD_LINK?>" target="_blank">Descargar SEO PANEL</a> \r\n        </p> \r\n         \r\n        <p> \r\n            <a href="<?=SP_DEMO_LINK?>" target="_blank">Demo SEO PANLE</a> \r\n        </p> \r\n         \r\n        <p> \r\n            <a href="<?=SP_CONTACT_LINK?>" target="_blank">Conatctar a SEO PANEL</a> \r\n        </p> \r\n         \r\n        <p> \r\n            <a href="<?=SP_HELP_LINK?>" target="_blank">Guia de Ayuda SEO PANEL</a> \r\n        </p> \r\n         \r\n        <p> \r\n            <a href="<?=SP_FORUM_LINK?>" target="_blank">Foro SEO PANEL</a> \r\n        </p> \r\n         \r\n        <p> \r\n            <a href="<?=SP_SUPPORT_LINK?>" target="_blank">Sistema de Soporte de SEO PANEL</a> \r\n        </p> \r\n         \r\n        <p> \r\n            <a href="<?=SP_DONATE_LINK?>" target="_blank">Donar a SEO PANEL</a> \r\n        </p> \r\n    </li> \r\n     \r\n</ul> \r\n</fieldset>', '2014-01-06 13:53:36'),
