(7909, 'vn', 'support', 'support_cont1', '<fieldset>\r\n<legend>H thng h tr Seo panel</legend>\r\n<ul class=\\"infobox\\">\r\n    <li>\r\n        <h1>Gi 1000 danh b</h1>\r\n        <p>\r\n            Chng ti ang cung cp <b>min ph kch hot v xc minh 1000</b> gi danh bth mc internet,  thm vo\r\nca bn seo panel <b> cng c gi danh b</b>.\r\n            N s gip bn <b> tng backlinks </b> ca trang web ca bn.\r\n            Trn thc t 1000 danh sch th mc danh b l <b> gii thiu </b>  thu thp mt s tin cho <b> tng lai\r\npht trin </b> seo panel.\r\n             c c 1000 danh sch th mc xin vui lng <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\"> ng h </a>\r\n$10 hoc nhiu hn  ci thin cc tnh nng ca bng iu khin seo.\r\n            Nu bn c bt k cu hi v 1000 gi th mc, xin vui lng <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\"> lin h vi chng ti </a> hoc m mt v trong <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\"> h thng h tr </a>.\r\n        </p>\r\n        <p>\r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\"> Bn hy xem lin kt ny  quyn gp cho seo panel</a>\r\n        </p>\r\n    </li>\r\n    \r\n    <li>\r\n        <h1> a phng Tm kim Cng c trn gi </h1>\r\n        <p>\r\n            Thm <b> lnh vc cng c tm kim a phng </b> ca google, yahoo, msn (<b> v d nh: www.google.de, www.google.fr... </b>)  kim tra <b> v tr bng iu khin t kha seo </b>,  theo di Bin trang web ca bn ti a phng.\r\n             c c cng c tm kim a phng gi (theo yu cu ca bn), xin vui lng <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\"> ng h </a> $ 10 hoc nhiu hn  ci thin cc tnh nng ca seo\r\nbng iu khin.\r\n            Trc khi gi ng h, xin vui lng <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">lin h vi chng ti</a> cung cp chng ti yu cu danh sch cng c tm kim tn min.\r\n            <br>\r\n            Ngoi ra  thm cng c tm kim <b> mi (v d nh: baidu.com) </b>  kim tra bng iu khin v tr ca bn seo t kha, xin vui lng <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\"> lin h vi chng ti </a> hoc m mt v my bay trong mt\r\n<a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\"> h tr h thng </a>.\r\n        </p>\r\n        <p class=\\"visit\\">\r\n            <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\"> Bn hy xem lin kt ny  lin h vi chng ti </a>\r\n        </p>        \r\n    </li>\r\n    \r\n    <li>\r\n        <h1> Seo Panel Plugins </h1>\r\n        <p>\r\n            Thm <b> seo plugin </b> vo bng seo ca bn  <b> m rng cc tnh nng </b> theo ca bn\r\nyu cu.\r\n            <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\"> seo panel b sung </a> c cung cp bi c hai bng iu khin seo\r\nv cc trang web ca bn th ba.\r\n            Bn cng c th d dng <b> pht trin </b> seo plugin cho bng iu khin seo ca bn.\r\n            Bn c th <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\"> trnh </a> Plugin seo seo bng v chng ti <b> s cng b </b> n trong trang web ca chng ti sau khi xem xt <b> ca chng ti </b> qu trnh.\r\n        </p>\r\n        <p>\r\n            <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\"> Bn hy xem lin kt ny  c c seo panel b sung </a>\r\n        </p>        \r\n    </li>\r\n    <li>\r\n        <h1> Lin h </h1>\r\n        <p>\r\n            Lin h vi chng ti  bt k cu hi no v <b> bng iu khin cng c seo, b sung v cc tnh nng ... </b> bng cch s dng lin kt di y.\r\n        </p>\r\n        <p>\r\n            <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\"> Bn hy xem lin kt ny  lin h vi chng ti </a>\r\n        </p>\r\n    </li>\r\n    <li>\r\n        <h1>Gi yu cu h tr </h1>\r\n        <p>\r\n             c c <b>h tr k thut</b> t nhm seo panel  thit lp cc cng c <b> seo panel, b sung cc tnh nng </b>. V d:  thit lp nh k  kim tra v tr t kha.\r\n        </p>\r\n        <p>\r\n            <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\"> Truy cp vo lin kt ny  to ra mt v h tr </a>\r\n        </p>        \r\n    </li>\r\n    <li>\r\n        <h1> Bo co cc li</h1>\r\n        <p>\r\n            Bo co <b> li </b> v <b> bng iu khin cng c seo, b sung v cc tnh nng ... </b> bng cch s dng lin kt di y.\r\n            xin vui lng gip chng ti ci tin cc tnh nng trong phin bn tip theo.\r\n        </p>\r\n        <p>\r\n            <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\"> Truy cp vo lin kt ny  bo co li </a>\r\n        </p>\r\n    </li>\r\n</ul>\r\n</fieldset>', '2012-02-02 16:27:48'),
(7910, 'vn', 'support', 'support_cont2', '<fieldset>\r\n<legend>Ti nguyn Online ca Seo Panel</legend>\r\n<ul class=\\"infobox\\">\r\n        \r\n    <li>\r\n        <h1>Hng dn tr gip Seo Panel</h1> \r\n        <p>\r\n            Ban c th xem <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\"> vn bnseo panel</a> trong \r\n<b>Hng dn tr gip</b>, n bao gm <b>vn bn</b> cho seo panel, plugins v cc tnh nng lin quan.\r\n            <br>N l ni tt nht trn internet  <b>c tr gip</b> v seo panel. Chng ti hy vng bn \r\n<b>gip </b> cho seo panel hng dn tr gip, nu bn tm thy li hoc bt c g bn ngh l thiu.                \r\n        </p>\r\n        <p>\r\n            <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">Xem Hng dn tr gip Seo Panel</a>\r\n        </p>\r\n        <br>\r\n    </li>    \r\n    <li>\r\n        <h1>Din n Seo Panel</h1> \r\n        <p>\r\n            L ni tho lun ca nhng ngi yu thch <b>bng iu kin seo m ngun m u tin ca th gii</b>. \r\n            y l ni tt nht  tm t <b>cu tr li</b> ti <b>cu hi</b> v seo panel. \r\n            <br>Bn cng c th <b>chia s</b>  <b>kinh nghim</b> ca bn trong qu trnh s dng seo panel  ti u\r\nwebsites ca bn.                               \r\n        </p>        \r\n        <p>\r\n            <a href=\\"<?=SP_FORUM_LINK?>\\" target=\\"_blank\\">Xem Din n Seo Panel</a>\r\n        </p>\r\n        <br>\r\n    </li>\r\n</ul>    \r\n</fieldset>', '2012-02-02 16:27:48'),
(7911, 'vn', 'support', 'support_cont3', '<fieldset> \r\n<legend>ng h cho Seo Panel</legend> \r\n<ul class=\\"infobox\\">         \r\n    <li> \r\n        <h1>ng h cho Seo Panel - Bng iu kin seo m ngun m u tin trn th gii</h1>  \r\n        <p> \r\n            <b>ng h</b> cho seo panel  h tr bng iu kin seo m ngun m u tin trn th gii. \r\n            Chng ti ang c k hoch <b>thm v nng cp</b> tnh nng ca seo panel trong tng lai.  \r\n            <br>Ch c <b>h tr</b> ca bn mi gip chng ti t c <b>mc tiu</b>. \r\n            If you feel that seo panel is <b>worth</b> for you, please ng h some amount to seo panel team. \r\n			Nu bn cm thy seo bng iu khin l <b> gi tr </b> cho bn, xin vui lng ng h mt s tin cho nhm seo panel.\r\n            <br>Chng ti s <b>cng khai</b> tn v website ca bn trn <a href=\\"<?=SP_DONATE_LINK?>\\"\r\ntarget=\\"_blank\\">trang ng h</a>, ngay khi chng ti nhn c ng h. \r\n        </p> \r\n        <p> \r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">Vo lin kt ny  ng h cho seo panel</a> \r\n        </p> \r\n        <br> \r\n    </li> \r\n</ul> \r\n</fieldset>', '2012-02-02 16:27:48'),
