(8215, 'sk', 'home', 'home_cont1', '<h1 style=\\"text-align: center;margin-bottom: 30px;font-size: 19px;\\">Vta vs SEO panel - prv svetov ovldac SEO panel na spravovanie viacerch webstrnok</h1>\r\n \r\n        <p> \r\n            Kompletn <b>SEO panel s otvorenm kdom</b> na spravovanie <b>optimalizcie</b> vaich webstrnok. \r\n            SEO panel je <b>nstroj pre SEO</b>, ktor zaha najnovie pikov SEO nstroje na <b>sledovanie a zvenie vkonu</b> vaich webstrnok. \r\n            Je to <b>vone stiahnuten softvr</b> zverejnen pod <b>GNU GENERAL PUBLIC LICENSE</b>. \r\n           \r\n            Hlavnou vhodou SEO panelu je jeho <b>rozritenos</b> pomocou <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">SEO pluginov</a>. \r\n            Ktokovek me jednoducho <b>vyvja a intalova</b> poadovan pluginy pro svoj SEO panel. \r\n        </p> \r\n        <p></p>\r\n        <p> \r\n            Tento vone dostupn softvr bol <b>vydan v januri 2010</b>. \r\n            Behom tejto <b>krtkej doby</b> <b>tisce administrtorov</b> pouva tento softvr k <b>optimalizcii</b> ich webstrnok. \r\n            Pouvejte SEO panel tie a <b>uite si</b> vetkho o svis so SEO pod <b>jedinou platformou</b>. \r\n        </p>       ', '2012-02-26 22:41:51'),
(8216, 'sk', 'home', 'home_cont2', '<fieldset> \r\n<legend>Hlavn vlastnosti aplikcie SEO Panel <?=SP_INSTALLED?></legend> \r\n<ul class=\\"infobox\\"> \r\n    <li>         \r\n        <h1>Automatick nstroj na registrciu do katalgov</h1> \r\n        <p> \r\n          Automatick nstroj na registrciu do katalgov nm umouje <b>registrova nae webstrnky</b> do hlavnch <b>bezplatnch a platench internetovch katalgov</b>.\r\n           Meme tie <b>zisova stav</b> kadej registrcie prostrednctvom <b>pravidelnch kontrol</b> pouitm skriptu <b>kontroly stavu registrcie</b>.\r\n           <b>Sprvca katalgov</b> nm pome zisti, i je <b>katalg aktvny</b>, alebo nie.\r\n        </p> \r\n    </li> \r\n    <li>         \r\n        <h1>Kontrola pozci kovch slov</h1> \r\n        <p> \r\n            Kontrola pozci kovch slov zist <b>pozcie kovch slov</b> vaej webstrnky v <b>internetovch vyhledvaoch</b> a <b>ulo ich</b> v systme.\r\n         V asti vpisov pozci kovch slov meme vidie <b>denn pozcie</b> kovch slov v rznych vyhadvaoch prostrednctvom <b>peknch grafov</b> a <b>detailnch vpisov</b>.\r\n        </p> \r\n    </li> \r\n    <li>        \r\n        <h1>Auditor webstrnky</h1>\r\n        <p>Auditor webstrnky <b>prejde vetky SEO faktory</b> kadej strnky na webe a pod nm\r\n<b>datailn vpis</b> o kadej strnke. Toto nm pome vytvori <b>XML,HTML,TEXT</b> sitemapu webstrnky, ktor meme <b>vloi</b> do vyhadvaov.</p>\r\n    </li> \r\n<li>        \r\n        <h1>Kontrola Google and Alexa rankov</h1>\r\n        <p>\r\n            Kontrola google and alexa rankov zist <b>google pagerank</b> a <b>alexa rank</b> naich webstrnok a <b>ulo</b> ich v systme.\r\n            V asti <b>vpisov rankov</b> meme vidie <b>denne</b> v <b>detailnch vpisoch</b> google pagerank and alexa rank kadej webstrnky .\r\n        </p>\r\n    </li>\r\n    <li>        \r\n        <h1>Kontrola sptnch odkazov</h1>\r\n        <p>\r\n            Nstroj na kontrolu sptnch odkazov njde <b>poet sptnch odkazov</b> naich webstrnok v rznych vyhadvaoch <b>(google,yahoo,msn at.)</b> a <b>ulo</b> ich v systme.\r\n            <br>V asti <b>vpisoch sptnch odkazov</b> meme vidie v <b>detailnch vpisoch</b> <b>denn mnostvo sptnch odkazov</b> kadej webstrnky.\r\n        </p>\r\n    </li> \r\n<li>        \r\n        <h1>Kontrola indexcie vyhadvami</h1>\r\n        <p>\r\n            Kontrola indexcie vyhadvami njde <b>poet zaindexovanch strnok</b> nach webstrnok v rznych vyhadvaoch <b>(google,yahoo,msn at.)</b> a <b>ulo</b> ich v systme.\r\n            V asti <b>kontrola indexcie vyhadvami</b> meme vidie <b>denn mnostvo zaindexovanch strnok</b> kadej webstrnky v <b>detailnch vpisoch</b>.\r\n        </p>\r\n    </li> \r\n<li>        \r\n        <h1>Seo Panel pluginy</h1>\r\n        <p>\r\n            <b>Hlavnou vhodou</b> SEO panelu je jeho <b>rozritenos</b>.\r\n            Pridajte si <b>SEO pluginy</b> do vho SEO panelu na <b>rozrenie funkci</b> v zvislosti na vaich poiadavkch.\r\n            <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">Seo panel pluginy</a> s poskytovan prostrednctvom SEO panelu a prostrednctovm tretch strn.\r\n            Mete tie jednoducho <b>vyvin</b> SEO pluginy pre v SEO panel.\r\n            Mete <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">vloi</a> v SEO plugin do seo panelu a my ho budeme <b>publikova</b> na naej webstrnke po naom <b>preskman</b>.\r\n        </p>\r\n    </li> \r\n    <li>        \r\n        <h1>Genertor meta tagov</h1>\r\n        <p>\r\n            Genertor meta tagov je <b>SEO panel plugin</b> na vytvranie <b>meta tagov</b> pre nau webstrnku.\r\n            Pome vm to da <b>viac informci</b> o naej webstrnke <b>vyhadvacm robotom</b>, poas toho ako prechdzaj nau webstrnku.\r\n        </p>\r\n    </li>\r\n</ul>\r\n</fieldset>\r\n   ', '2012-02-26 22:41:51'),
(8217, 'sk', 'home', 'home_cont3', '<fieldset>\r\n<legend>Seo Panel online zdroje</legend>    \r\n<ul class=\\"infobox\\">\r\n\r\n    <li>\r\n        <h1>Referencie</h1>                \r\n        \r\n        \r\n        <p>\r\n            <a href=\\"http://www.seopanel.in\\" target=\\"_blank\\">Oficilna strnka projektu</a>\r\n        </p>\r\n        <p>\r\n            <a href=\\"<?=SP_DOWNLOAD_LINK?>\\" target=\\"_blank\\">Stiahnu</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_DEMO_LINK?>\\" target=\\"_blank\\">Demo</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">Kontakt</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">Npoveda</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_FORUM_LINK?>\\" target=\\"_blank\\">Frum</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">Technick podpora</a>\r\n        </p>\r\n        \r\n        <p>\r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">Podpori</a>\r\n        </p>\r\n    </li>\r\n    \r\n</ul>\r\n</fieldset>', '2012-02-26 22:41:51'),
