(8458, 'sk', 'support', 'support_cont1', '<fieldset>\r\n<legend>Technick podpora SEO panelu</legend>\r\n<ul class=\\"infobox\\">\r\n    <li>\r\n        <h1>Balek 1000 katalgov</h1> \r\n        <p>\r\n            Poskytujeme balek <b>1000 vonch, aktvnych a overench</b> internetovch katalgov, ktor si mete prida do vho \r\n <b>nstroja na vkladanie do katalgov</b> vo vaom SEO paneli.\r\n            Pome vm to <b>zvi mnostvo sptnch odkazov</b> smerujcich na vau webstrnku.\r\n            Aktulny zoznam 1000 katalgov je <b>predstaven</b> na zskanie financi pre <b>budci vvoj</b> SEO panelu.\r\n            Na zskanie zoznamu 1000 katalgov prosm <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">darujte</a> 10 dolrov alebo viac na zlepenie funkci SEO panelu.\r\n            Ak mte akkovek otzky o balku 1000 katalgov, prosm <a href=\\"<?=SP_CONTACT_LINK?>\\"\r\ntarget=\\"_blank\\">kontaktujte ns</a> alebo kontaktujte <a href=\\"<?=SP_SUPPORT_LINK?>\\"\r\ntarget=\\"_blank\\">technick podporu</a>.   \r\n        </p>        \r\n        <p>\r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">Kliknite sem na dotciu SEO panelu</a>\r\n        </p>\r\n        <br>\r\n    </li> \r\n\r\n    <li>\r\n        <h1>Balek loklnych vyhadvaov</h1> \r\n        <p>\r\n            Pridajte si <b>loklne vyhadvacie domny</b> google,yahoo,msn (<b>napr. : www.google.de,www.google.fr\r\nat</b>) do <b>kontroly pozci kovch slov</b> v SEO paneli, na sledovanie vkonnosti vaej webstrnky v loklnych vyhadvaoch.\r\n            Na zskanie balka loklnych vyhadvaov (v zvislosti na vaich poiadavkch) prosm <a\r\nhref=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">darujte</a> 10 dolrov, alebo viac na zlepenie funkci SEO panelu.\r\n            Pred poslanm dotcie ns prosm <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">kontaktujte</a> a poskytnite nm poadovan zoznam domnovch vyhadvaov.\r\n            <br><br>              \r\n            Taktie na pridanie <b>novch vyhadvaov (eg:baidu.com)</b> do vaej kontroly pozci kovch slov, ns prosm <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">kontaktujte</a>, alebo zadajte poiadavku <a\r\nhref=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">technickej podpore</a>. \r\n        </p>        \r\n        <p class=\\"visit\\">\r\n            <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">Kontaktujte ns</a>\r\n        </p>\r\n        <br>\r\n    </li> \r\n<li>\r\n        <h1>Seo Panel Pluginy</h1> \r\n        <p>\r\n            Pridajte si <b>SEO pluginy</b> do vho SEO panelu na <b>rozrenie funkci</b> v zvislosti na vaich poiadavkch.\r\n            <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">Seo panel pluginy</a> s poskytovan SEO panelom a tretmi stranami.\r\n            Mete tie jednoducho <b>vyvja</b> SEO pluginy pre v SEO panel.\r\n            Mete <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">vloi</a> v SEO panel a my ho <b>zverejnme</b> na naej webstrnke po naom <b>preveren</b>.        \r\n        </p>        \r\n        <p>\r\n            <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">Dostupn pluginy SEO panelu</a>\r\n        </p>\r\n        <br>\r\n    </li> \r\n\r\n    <li>\r\n        <h1>Kontaktujte ns</h1> \r\n        <p>\r\n            Kontaktujte ns v prpade akchkovek otzok o <b>nstrojoch SEO panelu, pluginoch a funkcich at</b> pouitm tohto odkazu.        \r\n        </p>        \r\n        <p>\r\n            <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">Kontaktujte ns</a>\r\n        </p>\r\n        <br>\r\n    </li>\r\n <li>\r\n        <h1>Poiadavky na technick podporu</h1> \r\n        <p>\r\n            Ak potrebujete <b>technick podporu</b> od SEO panel tmu na nastavenie <b>nstrojov SEO panelu, pluginov a funkci</b>. Napr. : nastavenie cronu pre kontrolu pozci kovch slov. \r\n        </p>        \r\n        <p>\r\n            <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">Kontaktujte technick podporu</a>\r\n        </p>\r\n        <br>\r\n    </li> \r\n    <li>\r\n        <h1>Hlsenie chb</h1> \r\n        <p>\r\n            Ohlste <b>chyby</b> v <b>najstrojoch SEO panelu, pluginoch a funkcich at.</b> pouitm nasledujceho odkazu. \r\n            Prosm pomte nm zlepi funkcie v alch verzich.          \r\n        </p>        \r\n        <p>\r\n            <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">Hlsenie chb</a>\r\n        </p>\r\n        <br>\r\n    </li>    \r\n</ul>\r\n</fieldset>            ', '2012-02-23 07:25:15'),
(8459, 'sk', 'support', 'support_cont2', '<fieldset>\r\n<legend>Online zdroje Seo Panelu</legend>\r\n<ul class=\\"infobox\\">\r\n        \r\n    <li>\r\n        <h1>Sprievodca npovedou SEO panelu</h1> \r\n        <p>\r\n            Mete si prezrie <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">dokumentciu SEO panelu</a> v\r\n<b>sprievodcovi npovedou</b>. Obsahuje <b>dokumentciu</b> pre nstroje SEO panelu, pluginy a svisice funkcie.\r\n            <br>Je to najlepie miesto na internete, kde mete <b>dosta pomocn informcie</b> o SEO paneli. Dfame, e \r\n<b>prispejete</b> do sprievodcu npovedou SEO panelu, ak njdete chyby, alebo chbajce veci.                \r\n        </p>\r\n        <p>\r\n            <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">Navtvte sprievodcu npovedou SEO panelu</a>\r\n        </p>\r\n        <br>\r\n    </li>    \r\n    <li>\r\n        <h1>Frum SEO panelu</h1> \r\n        <p>\r\n            Miesto na diskusiu o prvom svetovom <b>SEO paneli</b> s otvorenm kdom. \r\n            Je to najlepie miesto na njdenie <b>odpoved</b> na <b>vae otzky</b> o SEO paneli. \r\n            <br>Mete tu tie <b>zdiela</b> vae <b>sksenosti</b> s pouvanm SEO panelu pri optimalizovan vaich webstrnok.                               \r\n        </p>        \r\n        <p>\r\n            <a href=\\"<?=SP_FORUM_LINK?>\\" target=\\"_blank\\">Navtvte frum SEO panelu</a>\r\n        </p>\r\n        <br>\r\n    </li>\r\n</ul>    \r\n</fieldset>', '2012-02-23 07:25:15'),
(8460, 'sk', 'support', 'support_cont3', '<fieldset>\r\n<legend>Dotcia SEO Panelu</legend>\r\n<ul class=\\"infobox\\">        \r\n    <li>\r\n        <h1>Dotcia SEO panelu - Prv SEO panel s otvorenm kdom na svete</h1> \r\n        <p>\r\n            <b>Dotcia</b> SEO panelu na podporu prvho SEO panelu s otvorenm kdom na svete.\r\n            Plnujeme do budcna <b>pridva a zlepova</b> funkcie SEO panelu. \r\n            <br>Len s vaou <b>podporou</b> meme dosiahnu nae <b>ciele</b>.\r\n            Ak si myslte, e SEO panel je pre vs <b>hodnotn</b>, tak prosm, darujte nejak iastku tmu SEO panelu.\r\n            <br>Ak dostaneme dotciu, <b>zverejnme</b> vae meno a informcie o webstrnke na <a href=\\"<?=SP_DONATE_LINK?>\\"\r\ntarget=\\"_blank\\">strnke darcov</a>.\r\n        </p>\r\n        <p>\r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">Finanne podpori SEO panel</a>\r\n        </p>\r\n        <br>\r\n    </li>\r\n</ul>\r\n</fieldset>', '2012-02-23 07:25:15'),
