(9792, 'pt-br', 'support', 'support_cont1', '<fieldset> \r\n<legend>Sistema de Suporte do SEO Panel</legend> \r\n<ul class="infobox"> \r\n    <li> \r\n        <h1>Pacote com 1000 Diretrios</h1>  \r\n        <p> \r\n            Ns estamos fornecendo <b>um pacote com 1000 diretrios ativos e gratuitos</b>, para adicion-los em seu SEO Panel, use <b>a ferramenta de envio de diretrios</b>. \r\n            Isto era te ajudar a <b>alavancar o nmero de backlinks</b> dos seus websites. \r\n            Atualmente a lista com 1000 diretrios  <b>utilizada</b> para coletar doaes que ajudaro no  <b>desenvolvimento do futuro</b> do SEO Panel. \r\n            Para ter acesso  lista com os 1000 diretrios, por favor <a href="<?=SP_DONATE_LINK?>" target="_blank">faa uma doao</a>\r\nde US$ 10,00 ou mais para auxiliar na criao de melhorias para as funes do SEO Panel. \r\n            Se voc tiver alguma dvida sobre o pacote de 1000 diretrios, por favor <a href="<?=SP_CONTACT_LINK?>"\r\ntarget="_blank">entre em contato conosco</a> ou abra um ticket em nosso <a href="<?=SP_SUPPORT_LINK?>"\r\ntarget="_blank">sistema de suporte</a>.    \r\n        </p>         \r\n        <p> \r\n            <a href="<?=SP_DONATE_LINK?>" target="_blank">Visite este link para doar ao SEO Panel</a> \r\n        </p> \r\n        <br> \r\n    </li> \r\n     \r\n    <li> \r\n        <h1>Local Search Engines Package</h1>  \r\n        <p> \r\n            Add <b>local search engine domains</b> of google,yahoo,msn(<b>eg: www.google.de,www.google.fr\r\netc</b>) to seo panel <b>keyword position checker</b>, to track your site perfomance locally. \r\n            To get local search engines package(according to your requirement) please <a\r\nhref="<?=SP_DONATE_LINK?>" target="_blank">donate</a> $10 or more to improve the features of seo\r\npanel. \r\n            Before sending donation, please <a href="<?=SP_CONTACT_LINK?>" target="_blank">contact us</a> to\r\nprovide us required search engine domain list. \r\n            <br><br>               \r\n            Also to add <b>new search engines(eg:baidu.com)</b> to your seo panel keyword position checker,\r\nplease <a href="<?=SP_CONTACT_LINK?>" target="_blank">contact us</a> or open a ticket in <a\r\nhref="<?=SP_SUPPORT_LINK?>" target="_blank">support system</a>.  \r\n        </p>         \r\n        <p class="visit"> \r\n            <a href="<?=SP_CONTACT_LINK?>" target="_blank">Visit this link to contact us</a> \r\n        </p> \r\n        <br> \r\n    </li> \r\n     \r\n    <li> \r\n        <h1>Seo Panel Plugins</h1>  \r\n        <p> \r\n            Add <b>seo plugins</b> to your seo panel to <b>extend the features</b> according to your\r\nrequirement. \r\n            <a href="<?=SP_PLUGINSITE?>" target="_blank">Seo panel plugins</a> are provided by both seo panel\r\nand third party sites. \r\n            You can also easily <b>develop</b> seo plugins for your seo panel. \r\n            You can <a href="<?=SP_PLUGINSITE?>" target="_blank">submit</a> your seo plugin to seo panel and\r\nwe will <b>publish</b> it in our website after our <b>review</b> process.         \r\n        </p>         \r\n        <p> \r\n            <a href="<?=SP_PLUGINSITE?>" target="_blank">Visit this link to get seo panel plugins</a> \r\n        </p> \r\n        <br> \r\n    </li>     \r\n    <li> \r\n        <h1>Contact Us</h1>  \r\n        <p> \r\n            Contact us for any questions about <b>seo panel tools,plugins and features etc</b> by using below\r\nlink.         \r\n        </p>         \r\n        <p> \r\n            <a href="<?=SP_CONTACT_LINK?>" target="_blank">Visit this link to contact us</a> \r\n        </p> \r\n        <br> \r\n    </li>     \r\n    <li> \r\n        <h1>Support Tickets</h1>  \r\n        <p> \r\n            To get <b>technical support</b> from seo panel team to setup the <b>seo panel tools,plugins and\r\nfeatures</b>. Eg: To set up cron for keyword position checker. \r\n        </p>         \r\n        <p> \r\n            <a href="<?=SP_SUPPORT_LINK?>" target="_blank">Visit this link to create a support ticket</a> \r\n        </p> \r\n        <br> \r\n    </li>     \r\n    <li> \r\n        <h1>Report Bugs</h1>  \r\n        <p> \r\n            Report <b>bugs</b> about <b>seo panel tools,plugins and features etc</b> by using below link.  \r\n            please help us to improve the features in next versions.           \r\n        </p>         \r\n        <p> \r\n            <a href="<?=SP_SUPPORT_LINK?>" target="_blank">Visit this link to report bugs</a> \r\n        </p> \r\n        <br> \r\n    </li>     \r\n</ul> \r\n</fieldset>', '2014-02-12 07:14:55'),
(9793, 'pt-br', 'support', 'support_cont2', '<fieldset>\r\nRecursos <legend> Seo Panel on-line </ legend>\r\n<ul class="infobox">\r\n\r\n<li>\r\nGuia de Ajuda <h1> Seo Panel </ h1>\r\n<p>\r\nVoc pode ver a <a href = "< ? = SP_HELP_LINK > " target = "_blank" > documentao do painel seo </ a> no\r\nguia de ajuda <b> < / b> , que contm a documentao <b> < / b> para as ferramentas do painel de seo , plugins, recursos entre outros.\r\n<br>  o melhor lugar na internet para obter ajuda <b> </ b> sobre o painel seo . Esperamos que voc\r\n<b> < / b> contribua para a guia do painel de ajuda seo, se voc encontrar erros ou coisas que faltam .\r\n</ p>\r\n<p>\r\n<a href = "< ? = SP_HELP_LINK > " target = "_blank" > Visite seo guia painel de ajuda </ a>\r\n</ p>\r\n<br>\r\n</ li>\r\n<li>\r\n<h1> Seo Panel Forum </ h1>\r\n<p>\r\nUm lugar para discutir sobre o painel de controle seo fonte <b> primeiro aberto do mundo </ b> .\r\n o melhor lugar para encontrar as respostas <b> </ b> para <b> suas perguntas </ b > sobre o painel de seo .\r\n<br> Tambm voc pode <b> share </ b> sua experincia <b> < / b> ao usar o painel de SEO para otimizar seu websites.\r\n</ p>\r\n<p>\r\n<a href = "< ? = SP_FORUM_LINK > " target = "_blank" > frum painel seo Visita </ a>\r\n</ p>\r\n<br>\r\n</ li>\r\n</ ul>\r\n</ fieldset >', '2014-02-12 07:14:55'),
(9794, 'pt-br', 'support', 'support_cont3', '<fieldset> \r\n<legend> Faa uma doao para Seo Panel </ legend> \r\n<ul class="infobox"> \r\n <li> \r\n <h1> Doar para Seo Panel - painel de controle seo Primeiro Open source no mundo </ h1> \r\n <p> \r\n <b> Doe </ b> para seo painel de apoiar primeiro painel de controle seo open source no mundo. \r\n Estamos planejando para <b> adicionar e melhorar </ b> caractersticas do painel de seo no futuro. \r\n V com todo o seu apoio <b> </ b> s ns podemos alcanar nossos objetivos <b> </ b>. \r\n Se voc sentir que o painel seo vale <b> </ b> para voc, por favor doe alguma quantia para seo time painel. \r\n <br> Vamos <b> publicar </ b> o seu nome e informaes do site em <a href = "<? = SP_DONATE_LINK>" \r\ntarget = "_blank"> pgina de doao </ a>, uma vez que temos de doao. \r\n </ p> \r\n <p> \r\n <a href = "<? = SP_DONATE_LINK>" target = "_blank"> Visite este link para doar para seo painel </ a> \r\n </ p> \r\n <br> \r\n </ li> \r\n</ ul> \r\n</ fieldset>', '2014-02-12 07:14:55'),
