(9963, 'lt', 'home', 'home_cont1', '<h1 style="text-align: center;margin-bottom: 30px;font-size: 19px;"> Sveiki atvyk  SEO Panel - Pasaul\r\n1. SEO valdymo pultas keletui svetaini </h1>\r\n        <p>\r\n            Pilnas <b> atviro kodo SEO valdymo pultas </b> valdymo <b> Search Engine Optimization </b> js tinklapis.\r\n            SEO skydas yra <b> SEO ranki rinkinys </b> yra naujausi karto SEO rankiai <b> padidjimo ir Track </b>\r\n<b> performace </b> savo interneto svetainse.\r\n            Tai yra <b> nemokama programin ranga </b> ileista pagal <b> GNU General Public License </b>.\r\n            Seo skydelio pagrindinis bruoas yra jos <b> extendability </b> naudodami <a href = "<?=SP_PLUGINSITE?>"\r\ntarget = "_blank"> SEO skiepi </a>.\r\n            Kiek vienas gali lengvai <b> kurti ir diegti </b>, kuri reikalinga skiepi savo SEO skydelyje.\r\n        </p>\r\n        <p> </p>\r\n        <p>\r\n            Tai atviro kodo programin rang, kuri buvo ileista <b> sausio 2010 </b>.\r\n            Su iame <b> trump laik </b> laiko <b> tkstaniai </b> i <b> interneto meistrai </b> naudoja i programin ranga <b> optimizuoti </b> savo interneto svetaines.\r\n            Naudokite SEO skydel iandien ir <b> mgaukits </b> visk, kas susij su SEO pagal <b> platforma </b>.\r\n        </p>', '2012-11-07 11:44:11'),
(9964, 'lt', 'home', 'home_cont2', '<fieldset>\r\n <legend>SEO Panel Pagrindins ypatybs <?=SP_INSTALLED?> </legend>\r\n<ul class="infobox">\r\n    <li>\r\n        <h1> Automatinio katalogo pateikimo rankis </h1>\r\n        <p>\r\n            Automatinis katalogo pateikimo rankis pads jums <b> pateikti js interneto svetain </b>  pagrindin <b> nemokamai ir mokam interneto katalogus </b>.\r\n            Mes taip pat galime <b> sekti status </b> kiekviename submision <b> periodinio patikrinime </b>, naudodami pateikimas <b> statusas tikrintuvas scenarijus </b>.\r\n            <b> katalogas vadybininkas </b> pads mums suinoti ar <b> katalogas yra aktyvus </b>, arba ne.\r\n        </P>\r\n    </Li>\r\n    <li>\r\n        <h1> Pozicijos raktaodi tikrintuvas </h1>\r\n        <p>\r\n            Pozicij tikrintuvas raktaodi rasite <b> paiekos pozicij </b> i <b> targetowan raktaodius </b>\r\njs svetain ir <b> parduotuvse </b> juos  sistem.\r\n            Raktaodi skyriaus ataskaitos apie jo buvimo viet, mes galime pamatyti <b> Dienos pozicijas </b> raktaodi\r\nvairiose paiekos sistemose pagal <b> grai grafik </b> ir <b> isamios ataskaitos </b>.\r\n        </P>\r\n    </Li>\r\n    <li>\r\n        <h1> Svetains auditorius </h1>\r\n        <p> Svetains auditorius, <b> patikrinta SEO veiksniai </b> kiekvienos svetains puslapi ir duos\r\n<b> isami ataskait </b> apie kiekvien puslap. Tai pads mums sukurti <b> XML, HTML, tekstas </b> Svetains\r\nfailus <b> pateikti ms interneto svetainje </b>  paiekos variklius. </p>\r\n    </Li>\r\n    <li>\r\n        <h1> Google ir Alexa Rank Checker </h1>\r\n        <p>\r\n            "Google" ir "Alexa Rank Checker rasite <B> Google PageRank </b> ir <b> alexa rank </b> ms\r\nsvetains ir <b> parduotuvse </b>  sistem.\r\n             <b> rango ataskaitos </b>,, mes galime pamatyti  <b> kasdien </b> "Google ir Alexa reiting kiekvieno svetains\r\npagal <b> isamias ataskaitas </b>.\r\n        </P>\r\n    </Li>\r\n    <li>\r\n        <h1> Atgalins tikrintuvo </h1>\r\n        <p>\r\n            Atgalins nuorodos tikrintuvas bus rasti Atgalins nuorodos </b> ms interneto svetainse <b> skaii vairiose paiekos\r\nvarikliai <b> (Google, Yahoo, MSN ir tt) </b> ir <b> parduotuvse </b> sistemoje.\r\n            "<br> <b> atgalin praneimai </b>, mes galime pamatyti <b> Dienos Atgalins skaiius </b> kiekvieno\r\nSvetain <b> isamias ataskaitas </b>.\r\n        </P>\r\n    </Li>\r\n    <li>\r\n        <h1> paieka Saturacija tikrintuvas </h1>\r\n        <p>\r\n            Paieka Variklis Saturacija tikrintuvas rasite <b> skaii indeksuot puslapi </b> ms interneto svetainse\r\nvairiose paiekos sistemose <b> (Google, Yahoo, MSN ir tt) </b> ir <b> parduotuvse </b> sistemoje.\r\n             <b> paiekos soties tikrinimas ataskaitos </b>, mes galime pamatyti <b> kasdien indeksuojami puslap\r\nskaiiuoti </b> kiekvien svetain, kuri pagal <b> isamias ataskaitas </b>.\r\n        </P>\r\n    </Li>\r\n    <li>\r\n        <h1> SEO Panel skiepiai </h1>\r\n        <p>\r\n            <b> Pagrindinis bruoas </b> SEO valdymo skydelyje yra jos <b> extentability </b>.\r\n            Pridkite <b> SEO skiepi </b>, kad js SEO skydelyje <b> iplsti funkcijas </b> pagal js\r\nreikalavimas.\r\n            <A href = "<?=SP_PLUGINSITE?>" Target = "_blank"> SEO skiepi skydelio </a> yra tiek SEO lange\r\nir treij ali svetaini.\r\n            Taip pat galite lengvai <b> sukurti </b> SEO skiepi js SEO skydelyje.\r\n            Galite <a href = "<?=SP_PLUGINSITE?>" Target = "_blank"> isiskite </a> js SEO skiepiai SEO skydelyje ir\r\nmes <b> Publikuoti </b> ms svetainje po ms <b> periros </b> proceso.\r\n        </P>\r\n    </Li>\r\n    <li>\r\n        <h1> Meta Tag Generator </h1>\r\n        <p>\r\n            Meta ymeles generatorius yra <b> SEO skydelis skiepiai </b> sukurti <b> Custom meta ymeles </b> ms\r\nsvetain.\r\n            Tai pads mums suteikti <b> daugiau informacijos </b> apie ms svetain  <b> paiekos sistemos robotai </b>\r\no jie nuskaityti ms interneto svetainje.\r\n        </P>\r\n    </Li>\r\n</Ul>\r\n</Fieldset>', '2012-11-07 11:44:11'),
