(10068, 'lt', 'support', 'support_cont3', '<fieldset>\r\n<legend> Paaukoti SEO skydo </legend>\r\n<ul class="infobox">\r\n    <li>\r\n        <h1> Paaukoti SEO Panel - Pirmasis atviras altinis SEO valdymo pulto pasaulyje </h1>\r\n        <p>\r\n            <b> Paaukok </b> SEO kolegij remti pirmj atviro kodo SEO valdymo pult pasaulyje.\r\n            Mes planuojame <b> pridti ir pagerinti </b> SEO skydelio savybes ateityje.\r\n            , <br> <b> param </b> tik mes galime pasiekti ms <b> tikslus </b>.\r\n            Jei manote, kad SEO skydelis yra <b> verta </b> jums, praome paaukoti tam tikr sum SEO skydelio komanda.\r\n            <br> <b> Publikuoti </b> savo vard ir svetains informacija <a href = "<?=SP_DONATE_LINK?>"\r\ntarget = "_blank"> donoryst puslapis </a>, kai mes gauname donoryst.\r\n        </p>\r\n        <p>\r\n            <a href = "<?=SP_DONATE_LINK?>" target = "_blank"> Aplankykite i nuorod, nordami paaukoti SEO skydelyje </a>\r\n        </p>\r\n        <br>\r\n    </li>\r\n</ul>\r\n</fieldset>', '2012-11-07 12:39:31'),
