(10661, 'ca', 'home', 'home_cont1', '<h1 style=\\"text-align: center;margin-bottom: 30px;font-size: 19px;\\">Benvingut a Seo Panel - La primera plataforma del mn per multiples llocs.</h1> \r\n        <p> \r\n            Una eina completa <b>de programari lliure</b> per administrar la <b>optimitzaci als motors de cerca</b> dels teus\r\nllocs web.  \r\n            Seo Panel es un <b>conjunt d\\''utilitats</b> que inclueixen les  ltimes eines per <b>incrementar i fer un seguiment </b> del\r\n<b>rendiment </b> dels teus llocs web. \r\n            Es una eina <b>gratuta</b> desenvolupada sota la llicncia <b>GNU GENERAL PUBLIC LICENSE</b>. \r\n            La principal funci de Seo Panel s la <b>extensibilitat</b> fent servir <a href=\\"<?=SP_PLUGINSITE?>\\"\r\ntarget=\\"_blank\\">seo plugins</a>. \r\n            Cualsevol pot fcilment <b>desenvolupar i installar</b> els plugins que necessiti per a l\\''s de Seo Panel.  \r\n        </p> \r\n        <p></p> \r\n        <p> \r\n            Aquest programari open source es va llenar al <b>Gener del 2010</b>. \r\n            En aquest <b>curt perode</b> de temps <b>centenars</b> de <b>web masters</b> l\\''utilitzen per <b>optimitzar</b> els seus llocs web. \r\n            Utilitza Seo Panel avu i <b>gaudeix</b> de tot el relacionat amb la <b> optimitzaci als motors de cerca</b> sota una nica <b>plataforma</b>. \r\n        </p>', '2013-01-30 10:48:41'),
(10662, 'ca', 'home', 'home_cont2', '<fieldset>\r\n<legend>Caracterstiques Principals de Seo Panel <?=SP_INSTALLED?></legend>\r\n<ul class=\\"infobox\\">\r\n    <li>        \r\n        <h1>Eina d\\''Afegit Automtic a Directoris</h1>\r\n        <p>\r\n            L\\''eina d\\''Afegit Automtic a Directoris ens ajuda a <b>afegir els nostres llocs web</b> en un gran nombre de directoris <b>gratuts i de pagament</b>.\r\n            Tamb es pot <b>fer un seguiment</b> de cada enlla afegit als directoris a travs de <b>comprovacions peridiques</b> utilitzant l\\''eina de <b>comprovar l\\''estat dels enllaos afegits</b>.\r\n            <b>Gestor de Directoris</b> ens ajudar a trobar quin <b>directori es actiu</b> o no.\r\n        </p>\r\n    </li>\r\n    <li>        \r\n        <h1>Comprobar la Posici de la paraula Clau</h1>\r\n        <p>\r\n            Keyword position checker will find the <b>search engine position</b> of <b>targetted keywords</b>\r\nof your website and <b>stores</b> it in the system.\r\n            In keyword position reports section, we can see the <b>daily positions</b> of keywords in\r\ndifferent search engines by <b>beautiful graphs</b> and <b>detailed reports</b>.\r\n        </p>\r\n    </li>\r\n    <li>        \r\n        <h1>Site Auditor</h1>\r\n        <p>Site Auditor will <b>audit all SEO factors</b> of each pages of a site and will give a\r\n<b>detailed report</b> about each page. This will help us to create <b>XML,HTML,TEXT</b> sitemap\r\nfiles of our website for <b>submit</b> to search engines.</p>\r\n    </li>\r\n    <li>        \r\n        <h1>Google and Alexa Rank Checker</h1>\r\n        <p>\r\n            Google and alexa rank checker will find <b>google pagerank</b> and <b>alexa rank</b> of our\r\nwebsites and <b>stores</b> it in the system.\r\n            In <b>rank reports</b> section, we can see the <b>daily</b> google and alexa rank of each website\r\nby <b>detailed reports</b>.\r\n        </p>\r\n    </li>\r\n    <li>        \r\n        <h1>Backlinks Checker</h1>\r\n        <p>\r\n            Backlinks checker will find <b>number of backlinks</b> of our websites in different search\r\nengines<b>(google,yahoo,msn etc)</b> and <b>stores</b> it in the system.\r\n            <br>In <b>backlink reports</b> section, we can see the <b>daily backlinks count</b> of each\r\nwebsite by <b>detailed reports</b>.\r\n        </p>\r\n    </li>    \r\n    <li>        \r\n        <h1>Search Engine Saturation Checker</h1>\r\n        <p>\r\n            Search Engine Saturation checker will find <b>number of indexed pages</b> of our websites in\r\ndifferent search engines<b>(google,yahoo,msn etc)</b> and <b>stores</b> it in the system.\r\n            In <b>search engine saturation checker reports</b> section, we can see the <b>daily indexed page\r\ncount</b> of each website by <b>detailed reports</b>.\r\n        </p>\r\n    </li>\r\n    <li>        \r\n        <h1>Seo Panel Plugins</h1>\r\n        <p>\r\n            The <b>major feature</b> of seo control panel is its <b>extentability</b>.\r\n            Add <b>seo plugins</b> to your seo panel to <b>extend the features</b> according to your\r\nrequirement.\r\n            <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">Seo panel plugins</a> are provided by both seo panel\r\nand third party sites.\r\n            You can also easily <b>develop</b> seo plugins for your seo panel.\r\n            You can <a href=\\"<?=SP_PLUGINSITE?>\\" target=\\"_blank\\">submit</a> your seo plugin to seo panel and\r\nwe will <b>publish</b> it in our website after our <b>review</b> process.\r\n        </p>\r\n    </li>\r\n    <li>        \r\n        <h1>Meta Tag Generator</h1>\r\n        <p>\r\n            Meta tag generator is a <b>seo panel plugin</b> for creating <b>custom meta tags</b> for our\r\nsite.\r\n            It will help us to give <b>more information</b> about our website to <b>search engine bots</b>\r\nwhile they crawl our website.\r\n        </p>\r\n    </li>\r\n</ul>\r\n</fieldset>', '2013-01-30 10:48:41'),
(10663, 'ca', 'home', 'home_cont3', '<fieldset> \r\n<legend> Recursos Online Seo Panel</legend>     \r\n<ul class=\\"infobox\\"> \r\n\r\n    <li> \r\n        <h1>Recursos Online Seo Panel per Referncia</h1>                 \r\n         \r\n         \r\n        <p> \r\n            <a href=\\"http://www.seopanel.in\\" target=\\"_blank\\">Lloc Oficial Seo Panel</a> \r\n        </p> \r\n        <p> \r\n            <a href=\\"<?=SP_DOWNLOAD_LINK?>\\" target=\\"_blank\\">Descarregar Seo Panel</a> \r\n        </p> \r\n         \r\n        <p> \r\n            <a href=\\"<?=SP_DEMO_LINK?>\\" target=\\"_blank\\">Demostraci de Seo Panel</a> \r\n        </p> \r\n         \r\n        <p> \r\n            <a href=\\"<?=SP_CONTACT_LINK?>\\" target=\\"_blank\\">Contactar amb Seo Panel</a> \r\n        </p> \r\n         \r\n        <p> \r\n            <a href=\\"<?=SP_HELP_LINK?>\\" target=\\"_blank\\">Gua d\\''Ajuda Seo Panel</a> \r\n        </p> \r\n         \r\n        <p> \r\n            <a href=\\"<?=SP_FORUM_LINK?>\\" target=\\"_blank\\">Frum Seo Panel</a> \r\n        </p> \r\n         \r\n        <p> \r\n            <a href=\\"<?=SP_SUPPORT_LINK?>\\" target=\\"_blank\\">Suport per a Seo Panel</a> \r\n        </p> \r\n         \r\n        <p> \r\n            <a href=\\"<?=SP_DONATE_LINK?>\\" target=\\"_blank\\">Donar a Seo Panel</a> \r\n        </p> \r\n    </li> \r\n     \r\n</ul> \r\n</fieldset>', '2013-01-30 10:48:41'),
