(11430, 'ca', 'support', 'support_cont1', '<fieldset>\r\n<legend>Sistema de Suport Seo Panel</legend>\r\n<ul class="infobox">\r\n    <li>\r\n        <h1>Paquet de 1000 Directoris</h1> \r\n        <p>\r\n            Estem provent <b>1000 directoris actius i verificats, </b> per afegir dins de  l''eina de  <b>Seo Panel "Afegir a directoris"</b>.\r\n            T''ajudar a <b>augmentar els enllaos </b> a la teva pgina.\r\n            Actualment la llista de drectoris <b>s''introduex </b> per recollir alguns diners per al <b>futur desenvolupament </b> de Seo Panel.\r\n            Per afegir els 1000 directoris siusplau <a href="<?=SP_DONATE_LINK?>" target="_blank">dona</a>\r\n$10 o ms per millorar les cualitats de seo panel.\r\n            Si tens alguna pregunta sobre el paquet de 100 directoris, siusplau <a href="<?=SP_CONTACT_LINK?>"\r\ntarget="_blank">contactan''s </a> o obre un tiquet a <a href="<?=SP_SUPPORT_LINK?>"\r\ntarget="_blank"> sistema de suport</a>.   \r\n        </p>        \r\n        <p>\r\n            <a href="<?=SP_DONATE_LINK?>" target="_blank">Visita aquest link per donar a Seo Panel</a>\r\n        </p>\r\n        <br>\r\n    </li>\r\n    \r\n    <li>\r\n        <h1>Paquets de Motors de Cerca locals</h1> \r\n        <p>\r\n            Afegeix <b> motors de cerca locals </b> com google,yahoo,msn(<b>eg: www.google.cat,www.google.es\r\netc</b>) a seo panel <b>comprobar paraules clau</b>, per portar un control del teu lloc als llocs webs de demarcaci propera.\r\n            Per adquirir el paquet de Motors de Cerca locals, si us plau <a\r\nhref="<?=SP_DONATE_LINK?>" target="_blank">dona</a> $10 o ms per millorar les funcions de Seo Panel.\r\n            Abans de fer una donaci, si us plau <a href="<?=SP_CONTACT_LINK?>" target="_blank">contacta''ns</a> per donar-nos una referncia de quins motors de cerca locals fas servir.\r\n            <br><br>              \r\n            Tamb per afegir <b>nous motors de cerca (eg:baidu.com)</b> al teu comprobador de paraules clau,\r\nsi us plau <a href="<?=SP_CONTACT_LINK?>" target="_blank">contacta''ns a</a> o obre un ticket a <a\r\nhref="<?=SP_SUPPORT_LINK?>" target="_blank">sistema de suport</a>. \r\n        </p>        \r\n        <p class="visit">\r\n            <a href="<?=SP_CONTACT_LINK?>" target="_blank">Visita aquest enlla per contactar-nos</a>\r\n        </p>\r\n        <br>\r\n    </li>\r\n    \r\n    <li>\r\n        <h1>Seo Panel Plugins</h1> \r\n        <p>\r\n            Afegeix <b>seo plugins</b> al teu panell seo panel a <b>extendre les funcions</b> a les teves necessitats.\r\n            <a href="<?=SP_PLUGINSITE?>" target="_blank">Seo panel plugins</a> son grcies a l''equip Seo Panel i altres llocs web.\r\n            Pots, fcilment <b>desenvolupar</b> plugins seo per al teu panell seo panel.\r\n            Pots <a href="<?=SP_PLUGINSITE?>" target="_blank">afegir</a> el teu seo plugin al teu Seo Panel i nosaltres <b>el publicarem</b> en el nostre lloc web despres del nostre procs de <b>revisi</b>.        \r\n        </p>        \r\n        <p>\r\n            <a href="<?=SP_PLUGINSITE?>" target="_blank">Visita aquest enlla per aconseguir seo plugins</a>\r\n        </p>\r\n        <br>\r\n    </li>    \r\n    <li>\r\n        <h1>Contacte</h1> \r\n        <p>\r\n            Contactans per cualsevol pregunta sobre <b>eines seo panel,plugins i funcionalitats </b> entrant en aquest enlla.\r\n        </p>        \r\n        <p>\r\n            <a href="<?=SP_CONTACT_LINK?>" target="_blank">Visita aquest enlla per contactar-nos.</a>\r\n        </p>\r\n        <br>\r\n    </li>    \r\n    <li>\r\n        <h1>Tiquets de suport</h1> \r\n        <p>\r\n            Per rebre <b>suport tcnic</b> de l''equip seo panel per configurar <b>les eines seo panel,plugins i caracterstiques</b>. Eg: Per configurar cron per el comprobador de paraules clau.\r\n        </p>        \r\n        <p>\r\n            <a href="<?=SP_SUPPORT_LINK?>" target="_blank">Visita aquest enlla per crear un tiquet de suport</a>\r\n        </p>\r\n        <br>\r\n    </li>    \r\n    <li>\r\n        <h1>Avisar de Errors</h1> \r\n        <p>\r\n            Avisa <b>d''errors </b> sobre <b>eines de seo panel, plugins i caracterstiques </b> utilitzant el seguent enlla. \r\n            Si us plau ajudan''s per millorar les caracterstiques de seo panel en les segents versions.          \r\n        </p>        \r\n        <p>\r\n            <a href="<?=SP_SUPPORT_LINK?>" target="_blank">Visita aquest enlla per avisar d''errors</a>\r\n        </p>\r\n        <br>\r\n    </li>    \r\n</ul>\r\n</fieldset>', '2014-01-16 14:34:57'),
